            migrationBuilder.InsertData(
                table: "Competencies",
                columns: new[] { "Id", "DescEng", "DescFre", "NameEng", "NameFre" },
                values: new object[,]
                {
                    { 23, "Classifies materiel according to Canadian Coast Guard and Public Services and Procurement Canada (PSPC) directives. Tracks materiel during receipt, storage, issue, and disposal.", "Classifie le matériel selon les directives de la Garde côtière canadienne et des Services publics et Approvisionnement Canada (SPAC). Assure le suivi du matériel pendant la réception, l'entreposage, la distribution et l'élimination.", "Materiel Management", "Gestion du matériel" },
                    { 19, "Applies the rules, policies, regulations, and procedures of the Financial Administration Act as they apply to the Canadian Coast Guard as well as the organization's financial assets and management procedures (including related procurement rules) such as: financial authority level and approval process, financial accounting procedures, public accountability, budgeting, projecting, monitoring, reporting, financial auditing, etc.", "Applique les règles, politiques, règlements et procédures de la Loi sur I' administration financière tels qu'ils s'appliquent à la Garde côtière canadienne ainsi que les actifs financiers et les procédures de gestion de l'organisation (y compris les règles d'approvisionnement connexes) tels que : le niveau d'autorité financière et le processus d'approbation, les procédures de comptabilité financière, la responsabilité publique, la budgétisation, la projection, la surveillance, la présentation de rapports, la vérification financière, etc.", "Financial Management for Supervisors/Managers", "Gestion financière pour les superviseurs/gestionnaires" },
                    { 20, "Consults with the chief cook in preparing menus and the economical use of provisions. Consults with the steward on all matters pertaining to accommodation, sanitation, and laundry facilities. Establishes requirements and procedures for the requisition, receipt, storage, and distribution of supplies. Collaborates with officers of the engine room department in the loading and moving of stores, supplies, and provisions.", "Consulte le chef cuisinier pour la préparation des menus et l'utilisation économique des provisions. Consulte le steward sur toutes les questions relatives à l'hébergement, aux installations sanitaires et aux buanderies. Établit les exigences et les procédures pour la réquisition, la réception, le stockage et la distribution des fournitures. Collabore avec les officiers du service des machines pour le chargement et le déplacement des magasins, des fournitures et des provisions.", "Hotel Services Management", "Gestion des services hôteliers" },
                    { 21, "Analyzes and gathers information to produce intelligence-driven products in collaboration with interdepartmental partners. Compiles data and information gathered from surveillance activities, intelligence investigations, security events, or incidents.", "Analyse et rassemble les informations pour produire des produits axés sur le renseignement en collaboration avec des partenaires interministériels. Compile les données et les informations recueillies lors d'activités de surveillance, d'enquêtes en matière de renseignement, d'événements de sûreté ou d'incidents.", "Maritime Security Operations Centre (MSOC)", "Centre des opérations de la sûreté maritime (COSM)" },
                    { 22, "Plans and carries out systematic activities implemented within the quality management system.", "Planifie et réalise des activités systématiques mises en œuvre dans le cadre du système de gestion de la qualité.", "Quality Assurance (QA)", "Assurance de la qualité (AQ)" },
                    { 24, "Plans and develops exercises (simulations of an emergency situation), which includes validating exercise plans, developing member skills, testing them during exercises, and testing established procedures. It includes a visual overview of the exercise, tracks related hours/cost of exercise, assigns responsibilities and logistical tasks.", "Planifie et développe des exercices (simulations d'une situation d'urgence), ce qui inclut la validation des plans d'exercices, le développement des compétences des membres, leur mise à l'épreuve lors des exercices et la mise à l'épreuve des procédures établies. Il comprend une vue d'ensemble visuelle de l'exercice, le suivi des heures/coûts de l'exercice, l'attribution des responsabilités et des tâches logistiques. ", "Exercise Planning", "Planification d'exercices" },
                    { 36, "Attracts and mobilizes members and colleagues towards a shared vision and purpose in the best interests of the Canadian Coast Guard and the public it serves. Motivates project members, sets achievable objectives, maintains a positive outlook, takes responsibility, makes decisions, and provides constructive feedback.", "Attire et mobilise les membres et les collègues vers une vision et un but communs dans le meilleur intérêt de la Garde côtière canadienne et du public qu'elle sert. Motiver les membres du projet, fixer des objectifs réalisables, maintenir une attitude positive, prendre des responsabilités, prendre des décisions et fournir une rétroaction constructive.", "Leadership", "Leadership" },
                    { 26, "Honours commitments and consistently strives to act in the public interest by ensuring that public trust and the law are not violated, while avoiding conflicts of interest and maintaining political and interpersonal neutrality.", "Respecter ses engagements et s'efforcer constamment d'agir dans l'intérêt public en veillant à ce que la confiance du public et la loi ne soient pas violées, tout en évitant les conflits d'intérêts et en maintenant une neutralité politique et interpersonnelle.", "Demonstrating Integrity and Respect", "Faire preuve d'intégrité et de respect" },
                    { 27, "Plans and adjusts work based on a thorough understanding of the Canadian Coast Guard's priorities. Obtains relevant information, considers all facts, and exercises sound judgement to formulate an opinion and/or make a decision. Analyzes situations and seeks feedback to learn from mistakes.", "Planifier et ajuster le travail en fonction d'une compréhension approfondie des priorités de la Garde côtière canadienne. Obtenir l'information pertinente, examiner tous les faits et exercer un jugement éclairé pour formuler une opinion ou prendre une décision. Analyse les situations et cherche à obtenir de la rétroaction pour tirer des leçons des erreurs.", "Thinking Things Through", "Réflexion approfondie" },
                    { 28, "Works cooperatively in order to achieve results. Works positively as part of a team and manages internal conflict. Identifies opportunities to work together within the organization to improve team dynamics and develop relationships. Seeks and builds internal/external alliances, collaborations, and partnerships to advance the Canadian Coast Guard's mandate.", "Travaille en collaboration afin d'obtenir des résultats. Travaille positivement en équipe et gère les conflits internes. Identifie les occasions de travailler ensemble au sein de l'organisation pour améliorer la dynamique d'équipe et développer les relations. Recherche et établit des alliances, des collaborations et des partenariats internes et externes pour faire progresser le mandat de la Garde côtière canadienne.", "Working Effectively With Others", "Travailler efficacement avec les autres" },
                    { 33, "Embraces change and actively looks for opportunities to learn and develop professionally and personally. Translates direction into concrete work activities. Identifies opportunities or issues, and takes action to enhance organizational results, without being prompted by others.", "Adopte le changement et cherche activement des occasions d'apprendre et de se perfectionner sur les plans professionnel et personnel. Traduit l'orientation en activités de travail concrètes. Cerner les possibilités ou les enjeux et prendre des mesures pour améliorer les résultats de l'organisation, sans y être incité par d'autres.", "Showing Initiative and Being Action Oriented", "Fait preuve d'initiative et est orienté vers l'action" },
                    { 18, "Manages unit or units workforce planning, recruitment, organizational design, classification issues, training and development, employment equity, official languages issues, performance management/labour relations, compensation issues, and rewards/recognition items.", "Gère la planification des effectifs de l'unité ou des unités, le recrutement, la conception organisationnelle, les questions de classification, la formation et le développement, l'équité en matière d'emploi, les questions de langues officielles, la gestion des performances/les relations de travail, les questions de rémunération et les éléments de récompense/reconnaissance.", "Workforce Management (HR) for Supervisors/Managers", "Gestion de l'effectif (RH) pour les superviseurs/directeurs" },
                    { 37, "The extent that members believe in the mission, mandate, and values of the Coast Guard and project that commitment through their actions and attitudes towards the organization and its stakeholders. Employee statements and deportment reflect a natural enthusiasm for the Coast Guard, what it does, and how it is viewed by the public.", "La mesure dans laquelle les membres croient en la mission, le mandat et les valeurs de la Garde côtière et projettent cet engagement par leurs actions et leurs attitudes envers l'organisation et ses intervenants. Les déclarations et la conduite des employés reflètent un enthousiasme naturel pour la Garde côtière, ce qu'elle fait et comment elle est perçue par le public.", "Canadian Coast Guard Cultural Awareness", "Sensibilisation à la culture de la Garde côtière canadienne" },
                    { 25, "Teaching or instructing adults in systematic and sustained self-educating activities so that they may gain new forms of knowledge, skills, attitudes, or values. This includes various forms of specific and generic instruction as required by the Canadian Coast Guard with an emphasis on the needs of adults and the results orientation of the organization.", "Enseigner ou instruire des adultes dans des activités d'auto-éducation systématiques et soutenues afin qu'ils puissent acquérir de nouvelles formes de connaissances, de compétences, d'attitudes ou de valeurs. Cela comprend diverses formes d'enseignement spécifique et générique, comme l'exige la Garde côtière canadienne, en mettant l'accent sur les besoins des adultes et l'orientation de l'organisation vers les résultats.", "Adult Teaching", "Enseignement aux adultes" },
                    { 17, "Provides a high standard of service to Canadian Coast Guard members and other stakeholders.", "Fournit un service de haute qualité aux membres de la Garde côtière canadienne et aux autres parties prenantes. ", "Support Services", "Services de soutien" },
                    { 34, "Promotes workplace safety. Follows safety guidelines, procedures, and regulations. Reacts safely and appropriately during emergencies. Integrates health and safety considerations in planning, response, and reviews.", "Favorise la sécurité au travail. Suit les directives, les procédures et les règlements en matière de sécurité. Réagit de manière sûre et appropriée en cas d'urgence. Intégrer les considérations de santé et de sécurité dans la planification, l'intervention et les examens.", "Apply Safety Considerations", "Intègre les considérations relatives à la sécurité" },
                    { 15, "Manages real property and facilities management activities on a whole-life basis.", "Gère les activités de gestion des biens immobiliers et des installations sur toute leur durée de vie.", "Real Property and Facilities Management", "Biens immobiliers et gestion des installations" },
                    { 16, "Establishes and enables processes in an organizational context, by defining needs and recommending solutions that deliver value to Canadian Coast Guard stakeholders.", "Établit et facilite les processus dans un contexte organisationnel, en définissant les besoins et en recommandant des solutions qui apportent de la valeur aux intervenants. ", "Business Analysis", "Analyse d'affaires" },
                    { 1, "Knowledge of the Canadian Coast Guard organization, partners, and relationships with Fisheries and Oceans Canada (DFO), and other internal and external stakeholders.", "Connaissance de l'organisation de la Garde côtière canadienne, des partenaires et des relations avec Pêches et Océans Canada (MPO) et d'autres intervenants internes et externes.", "Organizational Knowledge", "Connaissance de l'organisation" },
                    { 2, "Knowledge of the programs the Canadian Coast Guard manages and supports. Understands the services and delivery of program mandates:  Search and Rescue (SAR), Icebreaking (IB), Aids to Navigation (AtoN), Environmental Response (ER), Conservation and Protection (DFO C&P), Oceanography (DFO Science) and Fisheries Research (DFO Science).", "Connaissance des programmes que la Garde côtière canadienne gère et soutient. Comprend les services et l'exécution des mandats des programmes :  Recherche et sauvetage (SAR), Déglaçage, Aides à la navigation (AIDNAV), Intervention environnementale (IE), Conservation et protection (C&P du MPO), Océanographie (Sciences du MPO) et Recherche halieutique (Sciences du MPO).", "Program Knowledge and Application", "Connaissance et application du programme" },
                    { 3, "Understanding of administrative procedures and processes in one or more area of responsibility.", "Compréhension des procédures et processus administratifs dans un ou plusieurs domaines de responsabilité.", "Administrative Knowledge", "Connaissances en administration" },
                    { 5, "Knowledge of policies and directives on the management and administration of workforce management (HR) issues affecting seagoing personnel.", "Connaissance des politiques et directives relatives à la gestion et à l'administration des questions de gestion des effectifs (RH) touchant le personnel navigant.", "Seagoing Personnel Management", "Connaissance de la gestion du personnel navigant" },
                    { 6, "Knowledge of the coastal marine domain factors such as meteorology, shipping patterns, and security resources. Knowledge of the coastal security nets, its players, authorities, and roles. Knowledge of agency interoperabilities.", "Connaissance des facteurs du domaine maritime côtier tels que la météorologie, les modèles de transport maritime et les ressources de sécurité. Connaissance des filets de sécurité côtiers, de leurs parties concernées, de leurs autorités et de leurs rôles. Connaissance de l'interopérabilité des agences.", "Maritime Security (MSOC) Knowledge", "Connaissance du Centre des opérations de la sûreté maritime (COSM)" },
                    { 7, "Knowledge of the step by step process of analysis, design, development, implementation, and evaluation in the course of delivering training. May also be referred to as Instructional Systems Design, or ISD.", "Connaissance du processus étape par étape d'analyse, de conception, d'élaboration, de mise en œuvre et d'évaluation dans le cadre de la prestation de la formation. On peut aussi parler de conception de systèmes d'enseignement, ou DSI.", "Knowledge of Systems Approach to Training", "Connaissance de l'approche systémique de la formation" },
                    { 4, "Knowledge of the Incident Command System (ICS), its functions, role, and reporting structures. Knowledge of procedures and processes involved in an emergency response.", "Connaissance du Système de commandement du lieu de l'incident (SCI), de ses fonctions, de son rôle et de ses structures hiérarchiques. Connaissance des procédures et des processus d'intervention en cas d'urgence.", "Incident Command System (ICS) Knowledge", "Connaissance des systèmes de commandement des incidents (SCI)" },
                    { 9, "Manages a project or program while respecting procedures, operations, policies, and legislation, including inter-relationships with other departments, agencies, or the private sector. Project management involves effectively participating and/or integrating all aspects of a given finite project, ensuring that work progresses towards achieving goals and objectives. Program management involves effectively managing an ongoing activity line.", "Gère un projet ou un programme tout en respectant les procédures, les opérations, les politiques et la législation, y compris les relations avec d'autres ministères, organismes ou le secteur privé. La gestion de projet implique une participation efficace et / ou l'intégration de tous les aspects d'un projet fini donné, en veillant à ce que le travail progresse vers la réalisation des buts et des objectifs. La gestion de programme consiste à gérer efficacement une ligne d'activité continue.", "Project/Program Management", "Gestion de projet / programme" },
                    { 10, "Integrates various ideas, intentions, and information to form effective goals, objectives, timelines, action plans, and solutions.", "Intègre diverses idées, intentions et informations pour former des buts, objectifs, calendriers, plans d'action et solutions efficaces.", "Planning and Prioritizing", "Planification et établissement de priorités" },
                    { 11, "Manages the process of selecting vendors, establishing payment terms, strategic vetting, selection, the negotiation of contracts, and actual purchasing of goods.", "Gère le processus de sélection des fournisseurs, l'établissement des conditions de paiement, l'examen stratégique, la sélection, la négociation des contrats et l'achat effectif de biens.", "Procurement and Purchasing", "Approvisionnement et achat" },
                    { 12, "Plans, organizes, controls, and evaluates the operations of workforce management and personnel units. Develops and implements policies, programs, and procedures regarding workforce planning, recruitment, training, wellness, and career development.", "Planifier, organiser, contrôler et évaluer les opérations des unités de gestion des effectifs et du personnel. Élaborer et mettre en œuvre des politiques, des programmes et des procédures concernant la planification des effectifs, le recrutement, la formation, le bien-être et le perfectionnement professionnel.", "Workforce Management (HR) for Specialists", "Gestion de la main-d'œuvre (RH) pour les spécialistes" },
                    { 13, "Applies required financial procedures and tracking in order to manage public funds in an appropriate manner.", "Applique les procédures et le suivi financiers nécessaires pour gérer les fonds publics de manière appropriée.", "Financial Management for Specialists", "Gestion financière pour les spécialistes" },
                    { 14, "Encompasses written, oral, visual, and digital communication in an organizational context, as a specialty. Focuses on the study of information and the ways it is planned, created, managed, distributed, and consumed within the Canadian Coast Guard.", "Comprend la communication écrite, orale, visuelle et numérique dans un contexte organisationnel, en tant que spécialité. Se concentre sur l'étude de l'information et sur la façon dont elle est planifiée, créée, gérée, distribuée et consommée au sein de la Garde côtière canadienne.", "Communications for Specialists", "Communications pour les spécialistes" },
                    { 8, "Knowledge of specialized fields, including concepts, theories, principles, methods, techniques, and practices. Such knowledge can be acquired through formal education, experience, specialized or on-the-job training, self-education, or a combination.", "Connaissance de domaines spécialisés, y compris les concepts, théories, principes, méthodes, techniques et pratiques. Ces connaissances peuvent être acquises par le biais de l'éducation formelle, de l'expérience, de la formation spécialisée ou en cours d'emploi, de l'auto-éducation ou d'une combinaison des deux.", "Knowledge of Specialized Fields", "Connaissance des domaines spécialisés" }
                });

            migrationBuilder.InsertData(
                table: "CompetencyLevelRequirements",
                columns: new[] { "Id", "DescEng", "DescFre" },
                values: new object[,]
                {
                    { 109, "Implements the Canadian Coast Guard's quality assurance program. Interprets a wide variety of data and makes recommendations. Formulates recommendations for, or where appropriate, develops options to resolve non-conformities.", "Met en œuvre le programme d'assurance qualité de la Garde côtière canadienne. Interprète une grande variété de données et fait des recommandations. Formule des recommandations ou, le cas échéant, élabore des options pour résoudre les non-conformités." },
                    { 104, "Applies various constraints imposed by legislation and agreements by considering information sharing limitations when distributing products and/or information. Provides regular vessel tracking updates to partners as required. Analyzes information to contribute to products such as threat/risk assessments. Compiles and filters data received from partners for duplicates and unknowns. ", "Applique diverses contraintes imposées par la législation et les accords en tenant compte des limites du partage des informations lors de la distribution des produits et/ou des informations. Fournit aux partenaires des mises à jour régulières sur le suivi des navires, selon les besoins. Analyse les informations pour contribuer aux produits tels que les évaluations des menaces/risques. Compile et filtre les données reçues des partenaires pour détecter les doublons et les inconnues. " },
                    { 105, "Incorporates legal opinions into procedures and processes. Identifies new sources of information. Produces vessel movement analysis based on historical data from various sources. Identifies surveillance gaps to recommend new products to fill gaps. Advises management on potential maritime threats/risks when no obvious warning is present. Conceives new maritime security initiatives to expand services and products within Fisheries and Oceans Canada (DFO).", "Intègre les avis juridiques dans les procédures et les processus. Identifie de nouvelles sources d'information. Produit une analyse des mouvements des navires basée sur des données historiques provenant de diverses sources. Identifie les lacunes en matière de surveillance afin de recommander de nouveaux produits pour combler les lacunes. Conseille la direction sur les menaces/risques maritimes potentiels lorsqu'il n'y a pas d'avertissement évident. Conçoit de nouvelles initiatives de sûreté maritime pour étendre les services et les produits au sein de Pêches et Océans Canada (MPO)." },
                    { 106, "Develops formalized collection plans. Provides advice on maritime security incidents. Identifies new products to assist partners and clients in identifying potential threats. Collaborates with partners to develop maritime security operations centres (MSOC) products. Recommends capability of Canadian Coast Guard assets to and works with other government departments (OGDs) during maritime security events. Influences Coast Guard maritime security policy utilizing knowledge of partners changing initiatives, policies, and mandates.", "Élabore des plans de collecte formalisés. Fournit des conseils sur les incidents de sûreté maritime. Identifie de nouveaux produits pour aider les partenaires et les clients à identifier les menaces potentielles. Collabore avec les partenaires pour développer les produits des Centres des opérations de la sûreté maritime (COSM). Recommande la capacité des ressources de la Garde côtière canadienne à d'autres ministères et collabore avec eux lors d'événements de sûreté maritime. Influence la politique de sûreté maritime de la Garde côtière en utilisant la connaissance des initiatives, des politiques et des mandats changeants des partenaires." },
                    { 107, "Reports and logs observed non-conformities. ", "Rapporte et enregistre les non-conformités observées. " },
                    { 108, "Participates in reviews and drafts quality assurance reports. Researches and compares findings against standard operating procedures or design specifications.", "Participe aux examens et rédige des rapports d'assurance de la qualité. Effectue des recherches et compare les résultats par rapport aux procédures opérationnelles normalisées ou aux spécifications de conception." },
                    { 111, "Champions the Coast Guard's quality assurance (QA) program and systems. Develops creative and innovative programs, projects, and activities. Advises stakeholders on QA protocols and best practices. ", "Se fait le champion du programme et des systèmes d'assurance qualité (AQ) de la Garde côtière. Développe des programmes, des projets et des activités créatifs et innovants. Conseille les parties prenantes sur les protocoles d'AQ et les meilleures pratiques. " },
                    { 119, "Produces and validates tabletop exercises, which stimulate the divisions between responders needing to communicate and be coordinated, where the participants are expected to know the plan and test it for procedural weaknesses. ", "Produit et valide des exercices sur table, qui stimulent les divisions entre les intervenants ayant besoin de communiquer et d'être coordonnés, où les participants sont censés connaître le plan et le tester pour les faiblesses de procédure. " },
                    { 113, "Requests parts and supplies from internal stocks using approved classification system. Understands and follows the inventory management system (IMS). Processes special and emergency requirements of all clients.", "Demande des pièces et des fournitures à partir des stocks internes en utilisant un système de classification approuvé. Comprend et suit le Système de gestion des stocks. Traite les besoins spéciaux et urgents de tous les clients." },
                    { 114, "Receives, stores, issues, and records materiel according to approved inventory management system (IMS) and categories of materiel. Ensures that materiel held in stock is properly identified, catalogued, and incorporated in the centralized cataloguing files. Ensures that inventory is managed in accordance with Acts and regulations, when and where applicable. Maintains commitment control records for materiel requisitioned for stock and for non-stocked items.", "Reçoit, stocke, distribue et enregistre le matériel selon le système de gestion des stocks approuvé et les catégories de matériel. S'assure que le matériel en stock est correctement identifié, catalogué et incorporé dans les fichiers de catalogage centralisés. S'assure que l'inventaire est géré conformément aux lois et règlements, le cas échéant. Tient à jour les registres de contrôle des engagements pour le matériel demandé en stock et pour les articles non stockés." },
                    { 115, "Uses supplier classifications systems and cross-reference tables where available. Performs a full systematic process of developing, operating, maintaining, upgrading, and disposing, including commissioning and decommissioning of vessels as they relate to fleet operations, when and where applicable. ", "Utilise les systèmes de classification des fournisseurs et les tableaux de correspondance lorsqu'ils sont disponibles. Effectue un processus systématique complet de développement, d'exploitation, d'entretien, de mise à niveau et d'élimination, y compris la mise en service et le déclassement des navires en ce qui concerne les opérations de la flotte, le cas échéant. " },
                    { 116, "Attends national meetings and represents regional interests in the area of materiel management. Advises and guides management on cost-effective approaches. Tests new software and innovative approaches within the field. Trains and guides employees within the materiel management field, when and where applicable.", "Assiste aux réunions nationales et représente les intérêts régionaux dans le domaine de la gestion du matériel. Conseille et oriente la direction sur les approches rentables. Teste de nouveaux logiciels et des approches innovantes dans le domaine. Forme et guide les employés dans le domaine de la gestion du matériel, le cas échéant." },
                    { 117, "Provides input into basic exercise plans.", "Fournit des informations sur les plans d'exercices de base." },
                    { 118, "Participates in and validates discussion-based exercises in talking through plan finalization.  ", "Participe à des exercices basés sur la discussion et les valider en parlant de la finalisation du plan.  " },
                    { 103, "Identifies legal and regulatory limitations related to operations. Applies appropriate document classification to reports. Undertakes basic assignments in surveillance activities. Observes radar feeds and identifies basic trends, patterns, and anomalies.", "Identifie les limites légales et réglementaires liées aux opérations. Applique la classification appropriée des documents aux rapports. Effectue des missions de base dans le cadre d'activités de surveillance. Observe les signaux radar et identifie les tendances de base, les motifs et les anomalies." },
                    { 120, "Produces and validates live exercises in order to help participants develop skills  and confidence, testing logistics and physical capabilities, and providing experience of what it would be like to use a plan or procedure in real life. ", "Produit et valide des exercices en direct afin d'aider les participants à développer leurs compétences et leur confiance, en mettant à l'épreuve leurs capacités logistiques et physiques, et en leur donnant une expérience de ce que serait l'utilisation d'un plan ou d'une procédure dans la vie réelle. " },
                    { 112, "Requests supplies based on demand. Ensures that proper receipt, identification, and inspection is carried out for all incoming materiel.", "Demande des fournitures en fonction de la demande. S'assure que la réception, l'identification et l'inspection appropriées sont effectuées pour tout le matériel entrant." },
                    { 102, "Cites relevant sections of acts and regulations pertaining to maritime security operations centres (MSOC) (Privacy Act, Oceans Act, etc.). Identifies memoranda of understandings (MOUs) and service level agreements (SLAs) in place. Observes and records data for analysis from various sources.", "Cite les articles pertinents des lois et règlements relatifs aux centres des opérations de sûreté maritime (COSM) (Loi sur la protection des renseignements personnels, Loi sur les océans, etc.) Identifie les protocoles d'entente (PE) et les accords sur les niveaux de service  en vigueur. Observe et enregistre les données de diverses sources pour analyse." },
                    { 94, "Articulates the processes by which financial resources are identified, obtained, allocated, managed and accounted for. Makes sound financial decisions after having analyzed their impact on the organization and operations within the scope of fiscal responsibilities. Monitors the use of Coast Guard financial resources and budgets by employees, suppliers, partners or others. Complies with legislation, policies and practices applicable to the appropriate and effective use of financial resources. Takes a significant role in preparing budgets and forecasts for projects and initiatives.", "Articule les processus par lesquels les ressources financières sont identifiées, obtenues, allouées, gérées et comptabilisées. Prend des décisions financières judicieuses après avoir analysé leur impact sur l'organisation et les opérations dans le cadre des responsabilités fiscales. Surveille l'utilisation des ressources financières et des budgets de la Garde côtière par les employés, les fournisseurs, les partenaires ou autres. Se conformer à la législation, aux politiques et aux pratiques applicables à l'utilisation appropriée et efficace des ressources financières. Joue un rôle important dans la préparation des budgets et des prévisions pour les projets et les initiatives." },
                    { 100, "Manages the logistics department as a supply officer. Consults with the chief cook in preparing menus. Consults with the steward on matters pertaining to accommodation, sanitation, and laundry facilities. Establishes requirements and procedures for the requisition, receipt, storage, and distribution of supplies. Collaborates with officers of the engine room department in the loading and moving of stores and supplies.", "Gère le département logistique en tant qu'agent d'approvisionnement. Consulte le chef cuisinier pour la préparation des menus. Consulte le steward sur les questions relatives à l'hébergement, aux installations sanitaires et aux buanderies. Établit les exigences et les procédures pour la réquisition, la réception, le stockage et la distribution des fournitures. Collabore avec les officiers du département de la salle des machines pour le chargement et le déplacement des magasins et des fournitures." },
                    { 121, "Proposes, develops, trials, and validates all types of exercises, including discussion-based, table top, and live. Uses hotwash and lesson learned functions to propose changes and new exercises. Consults on developing testing exercises and training others. ", "Propose, développe, teste et valide tous les types d'exercices, y compris ceux basés sur des discussions, sur table et en direct. Utilise les fonctions de rétroaction immédiate et de leçons apprises pour proposer des changements et de nouveaux exercices. Consulte pour développer des exercices d'essai et former d'autres personnes. " },
                    { 84, "Applies due diligence and sound judgment when responding to requests and dealing with confidential information. Quickly and effectively solves client’s problems including complaints. Serves Coast Guard clients with the understanding that service is a core principle of the organization.", "Fait preuve de diligence et de discernement lorsqu'il répond aux demandes et traite des informations confidentielles. Résout rapidement et efficacement les problèmes des clients, y compris les plaintes. Sert les clients de la Garde côtière en sachant que le service est un principe fondamental de l'organisation." },
                    { 85, "Develops standards of service delivery beyond those generally accepted. Promotes innovative measures to address client service needs. Deals with stakeholders professionally while representing the Coastg Guard. ", "Développe des normes de prestation de services au-delà de celles généralement acceptées. Promeut des mesures innovantes pour répondre aux besoins des clients en matière de service. Traite avec les parties prenantes de manière professionnelle tout en représentant la Garde côtière. " },
                    { 86, "Strategically and systematically evaluates opportunities within a sector, field, or area to improve client service in a non-partisan manner. Develops and implements creative and innovative ways of meeting client needs, whether in the regions or in headquarters.", "Évalue de manière stratégique et systématique les possibilités d'améliorer le service à la clientèle dans un secteur, un domaine ou une région de manière non partisane. Développe et met en œuvre des moyens créatifs et innovants pour répondre aux besoins des clients, que ce soit dans les régions ou à l'administration centrale." },
                    { 87, "Identifies irregular workforce management practices. Seeks advice when workforce management issues arise. ", "Identifie les pratiques irrégulières de gestion de l'effectif. Demande des conseils lorsque des problèmes de gestion des effectifs se posent. " },
                    { 88, "Provides basic HR-related information to colleagues, members, and others. Identifies deviations in applications of HR procedures or validates them with the competent authority. Supervises a small unit and conducts performance management input. ", "Fournit des informations de base sur les ressources humaines aux collègues, aux membres et à d'autres personnes. Identifie les écarts dans l'application des procédures de RH ou les valide auprès de l'autorité compétente. Supervise une petite unité et apporte sa contribution à la gestion des performances. " },
                    { 89, "Addresses standard workforce management issues within areas of responsibility (AOR). Supervises or manages staff (operational or administrative). Provides performance feedback. Aligns workforce management practices to audit results and findings, when and where applicable. Provides on-the-job training and makes training and development recommendations. Participates on staffing boards and provides input into statements of merit criteria, when and where required.", "Fournit des informations de base sur les ressources humaines aux collègues, aux membres et à d'autres personnes. Identifie les écarts dans l'application des procédures de RH ou les valide auprès de l'autorité compétente. Supervise une petite unité et apporte sa contribution à la gestion des performances. " },
                    { 101, "Manages the logistics department as a logistics officer. Consults with the chief cook and steward in all matters pertaining to shipboard hotel provisions and systems. Consults with shoreside stakeholders and conducts logistics audits and training at sea and ashore. ", "Gère le département logistique en tant qu'officier de logistique. Consulte le chef cuisinier et le steward pour tout ce qui concerne les dispositions et les systèmes hôteliers à bord du navire. Consulte les parties prenantes à terre et effectue des audits logistiques et des formations en mer et à terre. " },
                    { 90, "Manages a unit. Participates on staffing boards and drafts statements of merit criteria, and, where applicable, conducts assessments. Manages unit member performance, including the development of objectives, learning plans, talent management and action plans, and dealing with disciplinary matters. Analyzes and forecasts workforce management needs and initiates required succession planning processes. Approves training requests by considering value for money. ", "Gère une unité. Participe aux commissions de dotation et rédige les énoncés des critères de mérite et, le cas échéant, procède à des évaluations. Gère les performances des membres de l'unité, y compris l'élaboration d'objectifs, de plans d'apprentissage, de gestion des talents et de plans d'action, et s'occupe des questions disciplinaires. Analyse et prévoit les besoins en matière de gestion des effectifs et lance les processus de planification de la relève nécessaires. Approuve les demandes de formation en tenant compte de l'optimisation des ressources. " },
                    { 92, "Prepares and processes bills, invoices, accounts payable and receivable. Enters data into financial tracking systems according to established procedures.", "Prépare et traite les factures, les comptes fournisseurs et les comptes clients. Saisit les données dans les systèmes de suivi financier conformément aux procédures établies." },
                    { 93, "Maintains Coast Guard unit assets and property (e.g. office equipment, vehicles, information databases, etc.). Updates budgets and projections. Purchases with credit cards when required. Runs salary and Operations and Maintenance (O&M) reports and statements for managers. Makes budget entries and reconciles accounts with rationales. Tracks and analyzes unit cash flow.", "Gère les actifs et les biens de l'unité de la Garde côtière (par exemple, le matériel de bureau, les véhicules, les bases de données d'information, etc.) ). Il met à jour les budgets et les projections. Effectue les achats par carte de crédit lorsque cela est nécessaire. Gère les salaires et les rapports et relevés de fonctionnement et d'entretien (F&E) pour les gestionnaires. Effectue des entrées budgétaires et rapproche les comptes avec les justifications. Suivre et analyser les flux de trésorerie des unités." },
                    { 95, "Ensures adequate internal control systems over the Coast Guard's financial assets, investments, liabilities, revenues, and expenditures. Manages financial and accounting responsibilities for large programs or multiple business lines. Identifies additional or alternative financial resources and opportunities for funding organization-wide projects, programs, research centers and/or services, etc. Acts on audit, evaluation, and other objective financial performance information. Sets up and manages income and expenditure monitoring systems and keeps these systems under close review and makes improvements where relevant. Uses delegated authority to purchase supplies for the work group. Performs a variety of financial management practices such as: budgeting, forecasting, cost benefits, risk analysis. ", "Assure des systèmes de contrôle interne adéquats sur les actifs financiers, les investissements, les engagements, les revenus et les dépenses de la Garde côtière. Gère les responsabilités financières et comptables pour les grands programmes ou les multiples secteurs d'activité. Identifie les ressources financières supplémentaires ou alternatives et les possibilités de financement de projets, programmes, centres de recherche et/ou services à l'échelle de l'organisation, etc. Agit sur la vérification, l'évaluation et d'autres informations objectives sur les performances financières. Met en place et gère des systèmes de contrôle des revenus et des dépenses, surveille de près ces systèmes et y apporte des améliorations le cas échéant. Utilise les pouvoirs délégués pour l'achat de fournitures pour le groupe de travail. Effectue diverses pratiques de gestion financière telles que : la budgétisation, les prévisions, les coûts-avantages, l'analyse des risques." },
                    { 96, "Ensures framework is in place for sound financial planning, management, control and reporting (i.e. spanning pay, capital, Operations and Maintenance [O&M] costs and revenues). Ensures processes and infrastructure provide managers with integrated financial and non-financial performance information, a mature approach to risk management, appropriate control systems, and a shared set of values and ethics. ", "S'assure que le cadre est en place pour une planification, une gestion, un contrôle et des rapports financiers sains (c'est-à-dire couvrant les salaires, le capital, les coûts et les revenus de fonctionnement et d'entretien [F&E]). S'assure que les processus et l'infrastructure fournissent aux gestionnaires des informations intégrées sur les performances financières et non financières, une approche mature de la gestion des risques, des systèmes de contrôle appropriés et un ensemble commun de valeurs et d'éthique." },
                    { 97, "Recognizes relations between shipboard departments and how they interact and the role of the cooks and stewards. Actively learns meal planning and storage protocols.", "Reconnaît les relations entre les services de bord et leur interaction, ainsi que le rôle des cuisiniers et des stewards. Apprend activement la planification des repas et les protocoles de stockage." },
                    { 98, "Manages the logistics department in the absence of a supply officer. Consults with the cook and steward in managing storage and purchasing protocols. Assists in menu planning. ", "Gère le service logistique en l'absence d'un responsable de l'approvisionnement. Consulte le cuisinier et le steward pour la gestion des protocoles de stockage et d'achat. Aide à la planification des menus. " },
                    { 99, "Manages the logistics department in the absence of a logistics officer. Consults with the chief cook in preparing menus. Consults with the steward on matters pertaining to accommodation. Establishes requirements for the requisition, receipt, storage, and distribution of supplies. Collaborates with the engine room department in the loading of stores.", "Gère le service de la logistique en l'absence d'un responsable de la logistique. Consulte le chef cuisinier pour la préparation des menus. Consulte le steward sur les questions relatives au logement. Établit les exigences pour la réquisition, la réception, le stockage et la distribution des fournitures. Collabore avec le service de la salle des machines pour le chargement des magasins." },
                    { 91, "Manages several units or projects. Develops complex workforce management plans that capitalize on recruitment, performance management, etc. Exercises an influence on Canadian Coast Guard workforce management strategic planning and development, succession planning, and other workforce management areas. Contributes to linking policies and systems to performance management processes, competencies, and performance outcomes in support of broader organizational goals. Ensures alignment of workforce management plans with the objectives of the Coast Guard's overall program strategy.", "Gère plusieurs unités ou projets. Élabore des plans complexes de gestion des effectifs qui tirent parti du recrutement, de la gestion des performances, etc. Exerce une influence sur la planification et le développement stratégique de la gestion des effectifs de la Garde côtière canadienne, la planification de la relève et d'autres domaines de gestion des effectifs. Contribue à relier les politiques et les systèmes aux processus de gestion des performances, aux compétences et aux résultats en matière de performances à l'appui d'objectifs organisationnels plus larges. Assure l'harmonisation des plans de gestion des effectifs avec les objectifs de la stratégie globale du programme de la Garde côtière." },
                    { 122, "Assesses learners’ prior knowledge, learning needs, and career and college readiness goals. Sets learning goals and a course of study. Monitors learning through summative and formative assessment. ", "Évalue les connaissances préalables des apprenants, leurs besoins d'apprentissage et leurs objectifs de carrière et de préparation au collège. Fixe des objectifs d'apprentissage et un programme d'études. Surveille l'apprentissage par le biais d'une évaluation sommative et formative. " },
                    { 144, "Considers ideas from a variety of sources in order to solve problems. Remains flexible to find alternate ways around obstacles/barriers to achieve goals. Takes calculated risks to achieve goals/outcomes. Perseveres in seeking solutions despite obstacles. Regularly evaluate and challenges work processes. Establishes effective organizational methods for assigning, managing, and tracking work, when and where applicable. Solicits and/or provides information that could affect the planning, programs, and decision-making for the Canadian Coast Guard.", "Tenir compte d'idées provenant de diverses sources afin de résoudre les problèmes. Reste flexible pour trouver d'autres moyens de contourner les obstacles/obstacles afin d'atteindre ses objectifs. Prend des risques calculés pour atteindre ses objectifs/résultats. Persévère dans la recherche de solutions malgré les obstacles. Évaluer et remettre en question régulièrement les processus de travail. Établir des méthodes organisationnelles efficaces pour l'attribution, la gestion et le suivi du travail, le cas échéant. Sollicite ou fournit de l'information qui pourrait influer sur la planification, les programmes et la prise de décisions de la Garde côtière canadienne." },
                    { 124, "Communicates high expectations of learners on Coast Guard employment in motivating them to meet  goals. Delivers lessons in a professional, clear, and understandable way. Engages in active listening, dialogue, and questioning to facilitate and support learning.", "Communique les attentes élevées des apprenants en matière d'emploi dans la Garde côtière en les motivant à atteindre leurs objectifs. Donne des cours de manière professionnelle, claire et compréhensible. S'engage dans une écoute active, un dialogue et un questionnement pour faciliter et soutenir l'apprentissage." },
                    { 146, "Sets standards and criteria for measuring success organizationally. Seizes opportunities and initiatives across organizational boundaries to achieve efficiencies consistent with the Coast Guard's vision. Creates an environment in which all systems and processes support high levels of efficiency. Champions the ongoing spirit of improvement and professional growth across the organization.", "Établit des normes et des critères pour mesurer le succès de l'organisation. Saisit les occasions et les initiatives au-delà des frontières organisationnelles pour réaliser des gains d'efficience conformes à la vision de la Garde côtière. Crée un environnement dans lequel tous les systèmes et processus soutiennent des niveaux élevés d'efficacité. Se fait le champion de l'esprit d'amélioration continue et de croissance professionnelle à l'échelle de l'organisation." },
                    { 147, "Awareness of the importance of safety in the Canadian Coast Guard. Familiar with the joining safety package.", "Sensibilisation à l'importance de la sécurité au sein de la Garde côtière canadienne. Familiarisé avec le paquet de sécurité d'assemblage." },
                    { 148, "Evaluates environment and adapts work to maintain safety. Ensures safety training is up to date. Uses appropriate personal protective equipment (PPE) when and where applicable. Applies proper safety procedures.", "Évalue l'environnement et adapte le travail pour maintenir la sécurité. Veiller à ce que la formation en matière de sécurité soit à jour. Utilise l'équipement de protection individuelle (EPI) approprié, s'il y a lieu. Appliquer les procédures de sécurité appropriées." },
                    { 149, "Conducts operations consistent with the Coast Guard Safety Management System (SMS), national and regulatory safety procedures, and policy when and where applicable. Understands the risks and manages safety and health issues when and where applicable. May participate in occupational health and safety groups and audits. ", "Mène ses opérations conformément au Système de gestion de la sécurité (SGS) de la Garde côtière, aux procédures de sécurité nationales et réglementaires et à la politique, le cas échéant. Comprend les risques et gère les questions de sécurité et de santé, le cas échéant. participer, s'il y a lieu, à des groupes et à des vérifications sur la santé et la sécurité au travail. " },
                    { 150, "Promotes a culture of unit safety. Ensures required personnel under supervision are trained in first aid and safety procedures. Ensures personnel under supervision apply safety plans and principles. Integrates health and safety planning in conformity with Incident Command Systems (ICS) principles when and where applicable. Integrates health and safety considerations in post-incident and post-exercise reviews.", "Favorise une culture de sécurité au sein de l'unité. Veiller à ce que le personnel nécessaire sous supervision soit formé aux premiers soins et aux procédures de sécurité. Veiller à ce que le personnel sous supervision applique les plans et les principes de sécurité. Intégrer la planification de la santé et de la sécurité conformément aux principes du Système de commandement des interventions (SCI), le cas échéant. Intégrer les considérations de santé et de sécurité dans les examens post-incident et post-exercice." },
                    { 151, "Promotes and integrates a culture of organizational safety. Develops risk analyses for responders and senior personnel regarding health and safety. Ensures required personnel are trained in first aid and safety procedures, as required. Leverages health and safety lessons learned from post-incident and post-exercise reviews in daily operations. ", "Promouvoir et intégrer une culture de sécurité organisationnelle. Élabore des analyses des risques en matière de santé et de sécurité à l'intention des intervenants et des cadres supérieurs. Veiller à ce que le personnel requis soit formé aux premiers soins et aux procédures de sécurité, au besoin. Tire profit des leçons en matière de santé et de sécurité tirées des examens post-incident et post-exercice dans les opérations quotidiennes. " },
                    { 152, "Listens to leaders and emulates positive behaviour through observation and imitation, when and where applicable. Recognizes personal limitations and is motivated to address and improve them. ", "Écouter les dirigeants et imiter les comportements positifs par l'observation et l'imitation, le cas échéant. Reconnaît ses limites personnelles et est motivé à y faire face et à les améliorer. " },
                    { 145, "Offers expertise to resolve problems. Plans ahead to address future requirements without being asked. Anticipates and responds in a proactive manner to future needs of internal or external clients or groups. Coaches, supports, and encourages others to test limits, when and where applicable. Seeks new opportunities to improve outcomes using innovative approaches to overcome obstacles and surpass performance goals.", "Offre une expertise pour résoudre les problèmes. Planifier à l'avance pour répondre aux besoins futurs sans qu'on le lui demande. Anticiper et répondre de façon proactive aux besoins futurs des clients ou des groupes internes ou externes. Entraîne, soutient et encourage les autres à tester les limites, le cas échéant. Cherche de nouvelles occasions d'améliorer les résultats en utilisant des approches novatrices pour surmonter les obstacles et dépasser les objectifs de rendement." },
                    { 153, "Adapts to change to help the team evolve in conjunction with the Coast Guard's evolving concerns. Seizes opportunities to increase skills and knowledge about operations, members, and stakeholders, when and where applicable. ", "S'adapte au changement pour aider l'équipe à évoluer en fonction de l'évolution des préoccupations de la Garde côtière. Saisit les occasions d'accroître les compétences et les connaissances sur les opérations, les membres et les intervenants, le cas échéant. " },
                    { 155, "Links members' individual development to organizational objectives and developing future leaders. Encourages innovation. Remains effective in the face of obstacles. Identifies and assesses risks in projects or decisions and produces realistic contingency plans to mitigate possible impacts. Exercises positive influence on the organization when needed. ", "Liens entre le développement individuel des membres et les objectifs de l'organisation et le développement des futurs leaders. Favorise l'innovation. Reste efficace face aux obstacles. Cerner et évaluer les risques associés aux projets ou aux décisions et produire des plans d'urgence réalistes pour atténuer les répercussions possibles. Exerce une influence positive sur l'organisation au besoin. " },
                    { 156, "Sets and champions organizational directions. Recognizes the big picture and cultivates organizational vision. Prioritizes the creation of a work environment that propels teams to step up to new challenges. Seamlessly assumes next level responsibilities. Regularly exercises persuasive influence on the organization in a wide variety of tactical and strategic areas.", "Établit et défend les orientations organisationnelles. Reconnaît l'ensemble de la situation et cultive la vision organisationnelle. Privilégie la création d'un environnement de travail qui incite les équipes à relever de nouveaux défis. Assume sans faille les responsabilités du niveau suivant. Exerce régulièrement une influence persuasive sur l'organisation dans une grande variété de domaines tactiques et stratégiques." },
                    { 157, "Articulates pride in being a member of the Coast Guard. Wears and maintains the uniform properly, when and where applicable.", "Exprime sa fierté d'être membre de la Garde côtière. Porte et entretient l'uniforme correctement, le cas échéant." },
                    { 158, "Expresses pride in the humanitarian and environmental nature of the Coast Guard's mission. Participates in organizational engagement activities. Wears the uniform proudly.", "Exprime sa fierté quant à la nature humanitaire et environnementale de la mission de la Garde côtière. Participer aux activités d'engagement organisationnel. Il porte fièrement l'uniforme." },
                    { 159, "Expresses pride in the Coast Guard's regional and/or national achievements. Incorporates and models the Coast Guard's ambitious vision and motto in daily practice and supports it within units. Articulates the Coast Guard's vision when providing advice or instructions internally. ", "Exprime sa fierté à l'égard des réalisations régionales ou nationales de la Garde côtière. Intégrer et modeler la vision et la devise ambitieuse de la Garde côtière dans la pratique quotidienne et l'appuyer au sein des unités. Articuler la vision de la Garde côtière lorsqu'elle donne des conseils ou des instructions à l'interne." },
                    { 160, "Propagates the Coast Guard's vision, mission, mandate, and programs internally and externally as an example of deep pride in the organization. Conveys the importance of the Coast Guard's work to members and stakeholders. Celebrates organizational achievements.", "Propager la vision, la mission, le mandat et les programmes de la Garde côtière à l'interne et à l'externe comme un exemple de fierté profonde envers l'organisation. Transmet l'importance du travail de la Garde côtière aux membres et aux intervenants. Célébrer les réalisations organisationnelles." },
                    { 161, "Models organizational pride in the Coast Guard's brand and the jobs it performs. Champions the organization when working collectively with internal and external stakeholders. Promotes organizational achievements and employee engagement events nationally. Strives to hone organizational excellence through celebration and pageantry.", "Donne l'exemple de la fierté organisationnelle à l'égard de l'image de marque de la Garde côtière et des tâches qu'elle accomplit. Se fait le champion de l'organisation lorsqu'elle travaille collectivement avec les intervenants internes et externes. Fait la promotion des réalisations organisationnelles et des activités d'engagement des employés à l'échelle nationale. S'efforce d'affiner l'excellence organisationnelle par la célébration et l'apparat." },
                    { 154, "Demonstrates interest in team members' success and well-being by listening and actively viewing situations through others' perspectives. Identifies strengths, leverages them, and persuades others for the benefit of the Coast Guard. Routinely teaches and guides work, based on operational knowledge through direct and indirect means. Seeks solutions by charting opinions and options.", "Démontre de l'intérêt pour le succès et le bien-être des membres de l'équipe en écoutant et en regardant activement les situations du point de vue des autres. Identifie les forces, les exploite et persuade les autres pour le bénéfice de la Garde côtière. Enseigne et guide régulièrement le travail, sur la base de connaissances opérationnelles, par des moyens directs et indirects. Cherche des solutions en dressant un tableau des opinions et des options." },
                    { 83, "Establishes and maintains electronic and paper filing systems so that information can be readily retrieved. Actively promotes services to existing and potential clients. Anticipates potential problems and initiates ways of improving standards. Complies with existing quality standards, procedures, guidelines, and service agreements. Asks questions in order to clarify the needs and requirements associated with initial client requests. ", "Établit et maintient des systèmes de classement électronique et papier afin que les informations puissent être facilement retrouvées. Promouvoir activement les services auprès des clients existants et potentiels. Anticipe les problèmes potentiels et met en place des moyens d'améliorer les normes. Respecte les normes de qualité, les procédures, les lignes directrices et les accords de service existants. Poser des questions afin de clarifier les besoins et les exigences associés aux demandes initiales des clients. " },
                    { 143, "Responds to issues and/or brings concerns forward rather than waiting for them to be reported by someone else. Looks for new opportunities and seizes them when they arise. Plans for contingencies to deal with unexpected events. Structures work in order to achieve required results. ", "Répondre aux questions ou aux préoccupations plutôt que d'attendre qu'elles soient signalées par quelqu'un d'autre. Cherche de nouvelles opportunités et les saisit lorsqu'elles se présentent. Des plans d'urgence pour faire face à des événements imprévus. Les structures fonctionnent de manière à obtenir les résultats escomptés. " },
                    { 142, "Completes work assignments. Balances work to meet commitments and deadlines by being focused on goals.", "Effectuer des affectations de travail. L'équilibre permet de respecter les engagements et les échéances en se concentrant sur les objectifs." },
                    { 125, "Participates in professional development networks and learning communities. Shares content and pedagogical resources with program staff in collaborative professional development projects. Refines instructional practices through reflection on experience, evidence, and data. Designs instruction to build learners’ subject matter of expertise skills (i.e. marine skills in the Coast Guard). ", "Participe à des réseaux de développement professionnel et à des communautés d'apprentissage. Partage le contenu et les ressources pédagogiques avec le personnel du programme dans le cadre de projets de développement professionnel collaboratifs. Raffine les pratiques pédagogiques par une réflexion sur l'expérience, les faits et les données. Conçoit l'enseignement de manière à renforcer les compétences des apprenants en matière d'expertise (c'est-à-dire les compétences maritimes de la Garde côtière). " },
                    { 126, "Champions a training environment featuring maximum flexibility, creativity, and passion, encouraging questions and discussion. Models an understanding of diversity in self and in students.", "Championne un environnement de formation caractérisé par un maximum de flexibilité, de créativité et de passion, encourageant les questions et la discussion. Modélise une compréhension de la diversité en soi et chez les étudiants." },
                    { 127, "Reads the Government of Canada's Values and Ethics Code. Behaves consistently with the Values and Ethics Code and seeks appropriate guidance when required. ", "Lire le Code de valeurs et d'éthique du gouvernement du Canada. Se comporte de manière cohérente avec le Code de valeurs et d'éthique et demande des conseils appropriés au besoin. " },
                    { 128, "Uses government assets responsibly. Discusses ethical concerns with their supervisor or colleagues and, when necessary, seeks and follows appropriate disclosure procedures.", "Utilise les biens du gouvernement de manière responsable. Discute de ses préoccupations éthiques avec son superviseur ou ses collègues et, si nécessaire, recherche et suit les procédures de divulgation appropriées." },
                    { 129, "Works in a manner that reflects a commitment to public service excellence. Assists peers respectfully when dealing with ethical concerns. Recognizes the importance of diversity, and bilingualism. Is well versed in the Government of Canada's Values and Ethics Code. Demonstrates respect for government property and policies.", "Fonctionne d'une manière qui reflète un engagement envers l'excellence de la fonction publique. Aide ses pairs de manière respectueuse lorsqu'il s'agit de questions éthiques. Reconnaît l'importance de la diversité et du bilinguisme. Connaît bien le Code de valeurs et d'éthique du gouvernement du Canada. Fait preuve de respect pour les biens et les politiques du gouvernement." },
                    { 130, "Consistently balances national, regional, and site specific ethical priorities. Actively promotes integrity, diversity, bilingualism, and respect through work behaviour and the workplace.  ", "Établir un équilibre constant entre les priorités éthiques nationales, régionales et propres au site. Promouvoir activement l'intégrité, la diversité, le bilinguisme et le respect par le comportement au travail et en milieu de travail." },
                    { 131, "Models public service before self. Assists and advises on issues with national and/or legal implications. Champions diversity and bilingualism. Acts with transparency and fairness. Enforces the appropriate use of government assets and resources.", "Donne l'exemple du service public avant soi-même. Aider et conseiller sur des questions ayant des implications nationales et/ou juridiques. Se fait le champion de la diversité et du bilinguisme. Agir avec transparence et équité. Appliquer l'utilisation appropriée des biens et des ressources du gouvernement." },
                    { 132, "Breaks down concrete problems into parts and organizes information. Recognizes pertinent facts and issues that make up a problem. Asks standard questions and follows first line of investigation to identify the key elements of a situation or problem. Uses known procedures and standard operating models.", "Décompose les problèmes concrets en parties et organise l'information. Reconnaît les faits et les enjeux pertinents qui constituent un problème. Poser des questions standard et suivre la première ligne d'investigation pour identifier les éléments clés d'une situation ou d'un problème. Utilise des procédures connues et des modèles d'exploitation normalisés." },
                    { 133, "Researches available options to recommend a solution. Understands the Coast Guard's operational and organizational goals and strategies, and aligns activities towards the vision and strategic imperatives. ", "Recherche les options disponibles pour recommander une solution. Comprend les buts et les stratégies opérationnels et organisationnels de la Garde côtière et aligne les activités sur la vision et les impératifs stratégiques." },
                    { 134, "Analyzes multiple causal relationships among several parts of a problem or situation. Anticipates the risks or implications inherent in a suggested plan of action and devises appropriate strategies to mitigate their impact. Makes a well-reasoned response even when faced with incomplete or contradictory information. Synthesizes complex ideas, issues, and observations into a clear understanding. Thinks beyond the work environment and makes decisions in the context of the bigger picture. ", "Analyse les relations causales multiples entre plusieurs parties d'un problème ou d'une situation. Anticiper les risques ou les implications inhérents à un plan d'action proposé et élaborer des stratégies appropriées pour en atténuer l'impact. Donne une réponse raisonnée, même lorsqu'elle est confrontée à des informations incomplètes ou contradictoires. Synthétise des idées, des questions et des observations complexes en une compréhension claire. Pense au-delà de l'environnement de travail et prend des décisions dans le contexte d'une vue d'ensemble. " },
                    { 135, "Identifies several potential causes of events or multiple-part consequences. Analyzes complex, evolving circumstances and takes corrective action to avoid resource constraints and meet deadlines. Compares and contrasts evidence and information from various sources in a comprehensive and time sensitive manner. Understands program interdependencies and the need to integrate activities across functions/areas related to project planning, program implementation, and evaluation. Creates strategic alignment between cross-functional teams. Thinks laterally about business problems and opportunities; sees how the work and efforts of other Coast Guard teams/functions/operational centres intertwine to meet broad objectives.", "Identifie plusieurs causes potentielles d'événements ou de conséquences en plusieurs parties. Analyser les circonstances complexes et changeantes et prendre des mesures correctives pour éviter les contraintes de ressources et respecter les échéances. Comparer et mettre en contraste les données et les renseignements provenant de diverses sources d'une manière exhaustive et dans des délais raisonnables. Comprend les interdépendances des programmes et la nécessité d'intégrer les activités entre les fonctions/domaines liés à la planification des projets, à la mise en œuvre des programmes et à l'évaluation. Crée un alignement stratégique entre les équipes interfonctionnelles. Réfléchit latéralement aux problèmes et aux possibilités d'affaires ; voit comment le travail et les efforts des autres équipes, fonctions et centres opérationnels de la Garde côtière s'entrecroisent pour atteindre les objectifs généraux." },
                    { 136, "Thinks strategically about the range of market and business issues likely to impact the Coast Guard's ability to fulfill its mandate. Uses a sound understanding of the organization's strengths and weaknesses, its key stakeholders, and its long-term organizational strategy to leverage decisions of varying scope. ", "Réfléchit de façon stratégique à l'éventail des enjeux commerciaux et commerciaux susceptibles d'avoir une incidence sur la capacité de la Garde côtière de remplir son mandat. Utilise une bonne compréhension des forces et des faiblesses de l'organisation, de ses principaux intervenants et de sa stratégie organisationnelle à long terme pour tirer parti des décisions de portée variable. " },
                    { 137, "Encourages members of the team to contribute to a process. Listens and asks questions. Expresses appreciation to others who have provided information assistance or support. Deals proactively with interpersonal matters that could affect team performance.", "Encourage les membres de l'équipe à contribuer à un processus. Écoute et pose des questions. Remercie les autres personnes qui lui ont fourni de l'information, de l'aide ou du soutien. Traite de façon proactive les questions interpersonnelles qui pourraient avoir une incidence sur le rendement de l'équipe." },
                    { 138, "Solicits opinions and viewpoints of team members. Cultivates personal bonds with colleagues in order to enhance performance throughout the organization. Discusses issues and exchanges information with partners to identify areas of mutual interest and benefit. Draws on other groups to facilitate project execution or persuade others. Manages personal work-life balance and respects the work-life balance of others.", "Sollicite les opinions et les points de vue des membres de l'équipe. Cultive des liens personnels avec ses collègues afin d'améliorer la performance dans l'ensemble de l'organisation. Discute des enjeux et échange de l'information avec les partenaires afin de cerner les domaines d'intérêt et d'avantage mutuels. Fait appel à d'autres groupes pour faciliter l'exécution du projet ou en persuader d'autres. Gère l'équilibre travail-vie personnelle et respecte l'équilibre travail-vie personnelle des autres." },
                    { 139, "Effectively promotes a respectful and positive work environment. Recognizes diverse needs and perspectives (e.g. language differences, cultural differences, disabilities, and personal family circumstances). Recognizes individuals' achievements, knowledge, and capabilities. Monitors the work environment, successfully identifies underlying issues that impact negatively on people, and takes appropriate action, when and where applicable. Seeks and influences new relationships outside own unit and identifies new collaborative partnerships that better position of the Coast Guard's programs and services. Identifies and creates opportunities to partner through networking and participating in cross-functional, multi-stakeholder groups.", "Favorise efficacement un milieu de travail respectueux et positif. Reconnaît la diversité des besoins et des perspectives (p. ex. les différences linguistiques, culturelles, les handicaps et les situations familiales personnelles). Reconnaît les réalisations, les connaissances et les capacités des individus. Surveille l'environnement de travail, identifie avec succès les problèmes sous-jacents qui ont un impact négatif sur les personnes et prend les mesures appropriées, le cas échéant. Recherche et influence de nouvelles relations à l'extérieur de sa propre unité et détermine de nouveaux partenariats de collaboration qui positionnent mieux les programmes et services de la Garde côtière. Identifie et crée des possibilités de partenariat grâce au réseautage et à la participation à des groupes multifonctionnels et multipartites." },
                    { 140, "Models and promotes a culture of respect, fairness, and trust. Proficient in capitalizing on the strengths of team members. Encourages members of the team to contribute to a process, and seeks consensus. Always actively works with other teams to ensure that broader common goals are met. Builds and nurtures effective and collaborative networks and relationships with communities of practice, colleagues, and stakeholders.", "Donne l'exemple et fait la promotion d'une culture de respect, d'équité et de confiance. Capitaliser sur les forces des membres de l'équipe. Encourage les membres de l'équipe à contribuer à un processus et recherche le consensus. Travaille toujours activement avec d'autres équipes pour s'assurer que les objectifs communs plus larges sont atteints. Établit et entretient des réseaux et des relations de collaboration efficaces avec les communautés de pratique, les collègues et les intervenants." },
                    { 141, "Advises others in dealing with ethical dilemmas, displaying sensitivity to diversity, and diverse needs in all dealings and relationships, and in maintaining fairness, consistency, and equity. Challenges current organizational behaviours and methods of operating, when and where applicable. Sets direction in terms of ethical standards and values for the organization. Draws on internal and external networks to help ensure buy-in and ownership; enhances the visibility of the Coast Guard's operations in the broader public sphere.", "Conseille les autres dans la gestion des dilemmes éthiques, en faisant preuve de sensibilité à la diversité et en répondant à des besoins divers dans toutes les transactions et relations, et en maintenant la justice, la cohérence et l'équité. Remet en question les comportements organisationnels et les méthodes de fonctionnement actuels, le cas échéant. Établit l'orientation en termes de normes et de valeurs éthiques pour l'organisation. Fait appel à des réseaux internes et externes pour assurer l'adhésion et l'appropriation ; améliore la visibilité des activités de la Garde côtière dans la sphère publique élargie." },
                    { 123, "Designs learner-centered classroom environments. Designs standards-based instructional units. Uses instructional techniques that are relevant and effective with adult learners. ", "Conçoit des cours centrés sur l'apprenant dans des environnements de classe. Conçoit des unités d'enseignement basées sur des normes. Utilise des techniques d'enseignement pertinentes et efficaces pour les apprenants adultes. " },
                    { 82, "Employs a fair and non-partisan approach in the delivery of services. Supports others in managing their tasks/responsibilities by providing timely information or resources. Accurately determines where to direct inquiries.", "Adopte une approche équitable et non partisane dans la prestation des services. soutient les autres dans la gestion de leurs tâches/responsabilités en leur fournissant des informations ou des ressources en temps utile. Détermine avec précision où diriger les demandes de renseignements." },
                    { 110, "Defines and articulates parameters and desired objectives, encouraging others to adopt and deliver on those objectives. Applies the constraints within which information can or cannot be shared. Assists in developing quality assurance (QA) programs. Provides summary reports detailing QA findings.", "Définit et articule les paramètres et les objectifs souhaités, en encourageant les autres à adopter et à atteindre ces objectifs. Applique les contraintes dans le cadre desquelles les informations peuvent ou non être partagées. Aide à l'élaboration de programmes d'assurance de la qualité (AQ). Fournit des rapports de synthèse détaillant les résultats de l'AQ." },
                    { 80, "Identifies and relays improvement opportunities and industry trends to the organization. Ensures a mechanism is in place to capture project risks, issues, and scope. Follows up with individuals and/or groups to clarify or complete the identified gaps and errors. Employees models to determine and communicate solution options. Makes recommendations with justifications to the appropriate decision making authority. ", "Identifie et transmet à l'organisation les opportunités d'amélioration et les tendances du monde industriel. S'assure qu'un mécanisme est en place pour saisir les risques, les problèmes et la portée du projet. Assurer un suivi avec des personnes et/ou des groupes pour clarifier ou compléter les lacunes et les erreurs identifiées. Les employés établissent des modèles pour déterminer et communiquer les options de solution. Fait des recommandations avec justifications à l'autorité décisionnelle appropriée. " },
                    { 22, "Basic knowledge of existing policies and documents related to seagoing personnel and where to locate them.", "Connaissance de base des politiques et documents existants relatifs au personnel navigant et savoir où les trouver." },
                    { 23, "Limited knowledge of the Canadian Coast Guard's documentation covering policies and directives related to crewing profile, rotation regulations, leave, medical fitness and training, and certification for seagoing personnel. ", "Connaissance limitée de la documentation de la Garde côtière canadienne couvrant les politiques et directives relatives aux profils d'armements en équipage, aux règlements de rotation, aux congés, à l'aptitude médicale, à la formation et à la certification du personnel navigant. " },
                    { 24, "Practical knowledge of the Coast Guard's seagoing dynamic environment. Understands applicable policies and directives when initiating administration processes related to seagoing personnel such as timesheet verification, scheduling and tracking medicals, using the crewing profiles, leave management, labour relations protocols, and using the MariTime system, etc.", "Connaissance pratique de l'environnement maritime dynamique de la Garde côtière. Comprendre les politiques et directives applicables lors du lancement de processus administratifs liés au personnel navigant, tels que la vérification des feuilles de temps, la programmation et le suivi des examens médicaux, l'utilisation des profils d'armement en équipage, la gestion des congés, les protocoles de relations de travail et l'utilisation du système MariTime, etc." },
                    { 25, "Advanced knowledge of the regional/national approaches in the application of any required policies and regulations related to operational personnel management. Understands new concepts and processes to improve recruitment, retention, and sustainment of the Coast Guard's seagoing personnel and its management. ", "Connaissance avancée des approches régionales/nationales dans l'application de toutes les politiques et réglementations nécessaires liées à la gestion du personnel opérationnel. Comprend les nouveaux concepts et processus visant à améliorer le recrutement, la rétention et le soutien du personnel navigant de la Garde côtière et de sa gestion. " },
                    { 26, "Expert knowledge in strategic guidance related to the seagoing personnel management doctrine.   Expertise in recommending, drafting, and implementation of policies related to the management of seagoing personnel. ", "Connaissances spécialisées en matière d'orientation stratégique liée à la doctrine de gestion du personnel navigant. Expertise en matière de recommandation, de rédaction et de mise en œuvre de politiques liées à la gestion du personnel navigant. " },
                    { 27, "Basic knowledge of coastal domain factors, working relations with other Canadian Coast Guard units, and equipment. ", "Connaissance de base des facteurs du domaine côtier, des relations de travail avec les autres unités de la Garde côtière canadienne et de l'équipement. " },
                    { 28, "Limited knowledge in supporting Fisheries and Oceans Canada's (DFO) marine security programs and conducting analyses using surveillance equipment and working with internal partners. ", "Connaissances limitées en matière de soutien aux programmes de sûreté maritime de Pêches et Océans Canada (MPO) et de réalisation d'analyses à l'aide d'équipements de surveillance et de collaboration avec des partenaires internes. " },
                    { 21, "Expert knowledge of the Incident Command System (ICS) and identifying new possibilities/capabilities to improve the existing systems and practices. Expertise in drafting/review of acts, regulations, and frameworks, and emergency management policies and directions. ", "Connaissance approfondie du Système de commandement du lieu de l'incident (SCI) et identification de nouvelles possibilités/capacités pour améliorer les systèmes et pratiques existants. Expertise dans la rédaction et l'examen des lois, des règlements et des cadres, ainsi que des politiques et des orientations en matière de gestion des urgences. " },
                    { 29, "Practical knowledge in the full range of the maritime security operations centres (MSOC),  its exercises, and its surveillance and analyses with internal partners.", "Connaissance pratique de toute la gamme des Centres d'opérations de la sûreté maritime (COSM), de leurs exercices, de leur surveillance et de leurs analyses avec les partenaires internes." },
                    { 32, "Basic knowledge of the training needs analysis process in relation to the Canadian Coast Guard's training gaps and requirements. ", "Connaissance de base du processus d'analyse des besoins de formation par rapport aux lacunes et aux exigences de formation de la Garde côtière canadienne. " },
                    { 33, "Limited knowledge of determining training elements including terminal objectives, training structure and outline, brief description of the training, and the method of delivery.", "Connaissance limitée de la détermination des éléments de formation, y compris les objectifs de l'aérogare, la structure et le plan de la formation, une brève description de la formation et la méthode de prestation." },
                    { 34, "Practical knowledge in developing enabling objectives. Understands the development of course materials and curriculum including the instructor lesson plan, participant handouts, assessments, and selected media such as PowerPoint presentations, video, or audio, etc. ", "Connaissances pratiques dans l'élaboration d'objectifs habilitants. Comprend l'élaboration du matériel didactique et du programme d'études, y compris le plan de leçon de l'instructeur, les documents à distribuer aux participants, les évaluations et certains médias comme les présentations PowerPoint, la vidéo ou l'audio, etc. " },
                    { 35, "Advanced knowledge in identifying methods and activities for presenting new information. Knowledge of setting aims and learning objectives. Understanding of the design strategy, for the development of new courses. Knowledge of making course modifications based on feedback. ", "Connaissances avancées dans l'identification de méthodes et d'activités pour la présentation de nouvelles informations. Connaissance de l'établissement des buts et des objectifs d'apprentissage. Compréhension de la stratégie de conception, pour le développement de nouveaux cours. Connaissance de la modification des cours en fonction des commentaires reçus. " },
                    { 36, "Expert knowledge of evaluating training results to determine whether the sessions led to required changes in behaviour for the participants. Knowledge in redefining course development, materials, and instructional methods. Understanding of briefing senior management regarding issues, trends, suggestions, and areas of improvement based on evaluation, including trends related to diversity and generational issues.", "Connaissance experte de l'évaluation des résultats de la formation afin de déterminer si les séances ont entraîné les changements de comportement requis pour les participants. Connaissance de la redéfinition de l'élaboration des cours, du matériel didactique et des méthodes d'enseignement. Compréhension de l'information donnée à la haute direction sur les enjeux, les tendances, les suggestions et les domaines à améliorer en fonction de l'évaluation, y compris les tendances liées à la diversité et aux questions générationnelles." },
                    { 37, "Basic knowledge of aspects of specialized fields to accomplish defined activities by applying methods, techniques, and established practices.", "Connaissance de base des aspects des domaines spécialisés pour accomplir des activités définies en appliquant des méthodes, des techniques et des pratiques établies. " },
                    { 38, "Limited knowledge of theories and principles of a specialized field and the relevancy to their application. ", "Connaissance limitée des théories et des principes d'un domaine spécialisé et de leur pertinence pour leur application. " },
                    { 31, "Expert knowledge of all facets of the marine security operations program and its relations with international and industrial stakeholders (e.g. United States Coast Guard [USCG], Ports). Expertise in providing insights to managers and stakeholders in advisory groups, the military, Canadian Security Intelligence Service (CSIS), and governments.", "Connaissance experte de toutes les facettes du programme d'opérations de sûreté maritime et de ses relations avec les parties prenantes internationales et industrielles (par exemple, la Garde côtière américaine [USCG], les ports). Expertise dans la fourniture d'informations aux gestionnaires et aux parties prenantes des groupes consultatifs, aux militaires, au Service canadien du renseignement de sécurité (SCRS) et aux gouvernements." },
                    { 20, "Advanced knowledge of the management of an Incident Command System (ICS) command and control structure. Knowledge of interoperability with other organizations such as regional, federal, provincial, territorial, and international partners, and response organizations. Understands and applies life cycle management of equipment. Understands national exercise program (NEP) principles.", "Connaissance approfondie de la gestion d'une structure de commandement et de contrôle du Système de commandement du lieu de l'incident (SCI). Connaissance de l'interopérabilité avec d'autres organisations comme les partenaires régionaux, fédéraux, provinciaux, territoriaux et internationaux, et les organismes d'intervention. Comprend et applique la gestion du cycle de vie de l'équipement. Comprend les principes du programme national d'exercices (PNE)." },
                    { 19, "Practical knowledge of the Incident Command System (ICS) during pollution incidents. Knowledge of the relationship between the Coast Guard Safety Management System (SMS) and the ICS. Understands how to determine optimum intervention options and determining the severity, sensitivity, and impact of an incident. Understands equipment specifications and maintenance requirements.", "Connaissance pratique du Système de commandement des interventions (SCI) lors d'incidents de pollution. Connaissance de la relation entre le Système de gestion de la sécurité (SGS) de la Garde côtière et le SCI. Comprend comment déterminer les options d'intervention optimales et déterminer la gravité, la sensibilité et l'impact d'un incident. Comprend les spécifications de l'équipement et les exigences d'entretien. " },
                    { 18, "Limited knowledge of the principles and working process of the Incident Command System (ICS). Knowledge of methodology for all Coast Guard incidents, emergency or contingency plans executed in environmental response, humanitarian assistance, maritime security, planned security events, Coast Guard internal incidents and major maritime incidents.", "Connaissance limitée des principes et du processus de travail du Système de commandement du lieu de l'incident (SCI). Connaissance de la méthodologie pour tous les incidents de la Garde côtière canadienne, des plans d'urgence ou de contingence exécutés dans les domaines de l'intervention environnementale, de l'aide humanitaire, de la sécurité maritime, des événements de sécurité prévus, des incidents internes de la Garde côtière et des incidents maritimes majeurs." },
                    { 81, "Identifies risks and impacts associated with proposed business options. Forecasts the impact of change. Applies effective influencing strategies. ", "Identifie les risques et les impacts associés aux options opérationnelles proposées. Prévoit l'impact du changement. Applique des stratégies d'influence efficaces. " },
                    { 1, "Basic knowledge of a unit in the Coast Guard organization chart and its reporting relationships.", "Connaissance de base d'une unité dans l'organigramme de la Garde côtière et de ses rapports hiérarchiques." },
                    { 2, "Limited knowledge of the Coast Guard's mandate and its relationship with Fisheries and Oceans Canada (DFO). Understands the organization's directorates regionally and/or nationally.", "Connaissance limitée du mandat de la Garde côtière et de ses relations avec Pêches et Océans Canada (MPO). Comprend les directions de l'organisation au niveau régional et/ou national. " },
                    { 3, "Practical knowledge of the Coast Guard and Fisheries and Oceans Canada (DFO) organizations, and of the Coast Guard as a special operating agency. Understands a program and its linkages to other programs and directorates regionally and/or nationally.", "Connaissance pratique des organisations de la Garde côtière et de Pêches et Océans Canada (MPO), ainsi que de la Garde côtière en tant qu'organisme de service spécial. Comprend un programme et ses liens avec d'autres programmes et directions au niveau régional et/ou national." },
                    { 4, "Advanced knowledge of the Coast Guard and Fisheries and Oceans Canada (DFO) organizations, directorates and associated programs and relations regionally and nationally.", "Connaissance avancée des organisations, directions et programmes associés à la Garde côtière et à Pêches et Océans Canada (MPO), ainsi que des relations régionales et nationales." },
                    { 5, "Expert knowledge of the Coast Guard and Fisheries and Oceans Canada (DFO) organizations and their interdependencies with other internal (includes other government departments) and external (includes industry and other governments) organizations. Expertise in providing advice and guidance to stakeholders about the organization and its capabilities.", "Connaissance approfondie des organisations de la Garde côtière et de Pêches et Océans Canada (MPO) et de leurs interdépendances avec d'autres organisations internes (y compris d'autres ministères) et externes (y compris l'industrie et d'autres gouvernements). Expertise dans la fourniture de conseils et d'orientations aux parties prenantes sur l'organisation et ses capacités." },
                    { 6, "Basic knowledge of the Coast Guard and its role as an enabler of various programs.", "Connaissance de base de la Garde côtière et de son rôle en tant que facilitateur de divers programmes." },
                    { 7, "Limited knowledge of the Coast Guard's functions and the roles and responsibilities of key Coast Guard contacts within a regional organizational setting. Understands some programs and assets well.", "Connaissance limitée des fonctions de la Garde côtière et des rôles et responsabilités des principaux contacts de la Garde côtière dans un cadre organisationnel régional. Comprend bien certains programmes et actifs." },
                    { 8, "Practical knowledge of program deliveries in a regional or national organizational setting.  Understands most programs and associated assets. Knowledge of key contacts for other programs. Comprehends roles and responsibilities of client partners.", "Connaissance pratique de l'exécution des programmes dans un cadre organisationnel régional ou national.  Comprend la plupart des programmes et les actifs associés. Connaissance des contacts clés pour d'autres programmes. Comprend les rôles et les responsabilités des partenaires clients." },
                    { 9, "Advanced knowledge of programs and their impacts on public and partner relations, regionally and/or nationally. Extensive knowledge of all the Coast Guard's programs and the capability and status of Coast Guard assets regionally and/or nationally. Understands program planning exercises.", "Connaissance avancée des programmes et de leurs impacts sur les relations publiques et les relations avec les partenaires, au niveau régional et/ou national. Connaissance approfondie de tous les programmes de la Garde côtière et de la capacité et du statut des biens de la Garde côtière au niveau régional et/ou national. Comprend les exercices de planification des programmes." },
                    { 10, "Expert knowledge of all the Coast Guard programs and delivery modes and timelines regionally and nationally. Understands expectations and needs of stakeholders for the Coast Guard and other government departments (OGDs) in planning and exercises. Understands the significance of potential program efficiencies, changes, or expansion opportunities.", "Une connaissance approfondie de tous les programmes de la Garde côtière, ainsi que des modes et des délais de prestation à l'échelle régionale et nationale. Comprend les attentes et les besoins des parties prenantes pour la Garde côtière et les autres ministères dans le cadre de la planification et des exercices. Comprend l'importance de l'efficacité, des changements ou des possibilités d'expansion des programmes." },
                    { 12, "Understands basic administrative tasks and rules as they relate to a position. Recognizes the need to have supervisor approve requests where applicable.", "Comprend les tâches et les règles administratives de base liées à un poste. Reconnaît la nécessité de faire approuver les demandes par le superviseur, s'il y a lieu. " },
                    { 13, "Recognizes when administration requirements are met. Understands systems and software pertaining to administrative functions and where applicable, the shipboard logistics functions in the performance of duties.", "Reconnaît quand les exigences administratives sont satisfaites. Comprend les systèmes et les logiciels relatifs aux fonctions administratives et, s'il y a lieu, aux fonctions logistiques à bord du navire dans l'exécution des tâches." },
                    { 14, "Understands the full range of administration services such as expense forms, reimbursements (travel, stores, etc.) and where applicable items such as ex gratiapayments, timesheets, drafting correspondence and reports, training requests and authorizations, etc.", "Comprend la gamme complète des services administratifs tels que les formulaires de dépenses, les remboursements (voyages, magasins, etc.) et, le cas échéant, les dépenses ex gratiapayments, les feuilles de temps, la rédaction de correspondance et de rapports, les demandes et autorisations de formation, etc." },
                    { 15, "Understands the full administration requirements of a sector or unit and how they interrelate with one another to effect efficient transactions throughout. Knowledge of all applicable policies, standards etc., to perform duties.", "Comprend toutes les exigences administratives d'un secteur ou d'une unité et la façon dont elles sont reliées les unes aux autres pour effectuer des transactions efficaces tout au long du processus. Connaissance de toutes les politiques, normes, etc. applicables à l'exécution des tâches." },
                    { 16, "Expert knowledge in the administrative functions of multiple units working together and the needs of a work site, when and where applicable. Awareness of national and regional initiatives related to the administrative functions of a unit or units.", "Connaissance approfondie des fonctions administratives de plusieurs unités travaillant ensemble et des besoins d'un lieu de travail, le cas échéant. Connaissance des initiatives nationales et régionales liées aux fonctions administratives d'une ou de plusieurs unités." },
                    { 17, "Basic understanding of the different Incident Command System (ICS) elements and incident levels. Understands the established and applicable operational procedures within ICS. Knowledge of associated computer software and hardware.", "Compréhension de base des différents éléments du Système de commandement du lieu de l'incident (SCI) et des niveaux d'incident. Comprend les procédures opérationnelles établies et applicables au sein du SCI. Connaissance des logiciels et du matériel informatique connexes. " },
                    { 39, "Practical knowledge of specialized methodologies of a field and comprehensive understanding of their underlying concepts, theories, and principles. ", "Connaissance pratique des méthodologies spécialisées d'un domaine et compréhension approfondie de leurs concepts, théories et principes sous-jacents. " },
                    { 40, "Advanced knowledge in specialized methodologies of a field and of their underlying concepts. Extensive comprehension of the methodologies, theories, and applied principles of a specialized field.", "Connaissance avancée des méthodologies spécialisées d'un domaine et de leurs concepts sous-jacents. Compréhension approfondie des méthodologies, théories et principes appliqués d'un domaine spécialisé." },
                    { 30, "Advanced knowledge of all facets of marine security operations, training, and analyses regionally or nationally, as well as training/consultation initiatives. Knowledge of Fisheries and Oceans Canada (DFO), Department of National Defence (DND), Royal Canadian Mounted Police (RCMP), Transport Canada (TC), and the Coast Guard's response systems, programs, and surveillance equipment (Long Range Identification and Tracking [LRIT], radars, cameras).", "Connaissance avancée de toutes les facettes des opérations de sûreté maritime, formation et analyses au niveau régional ou national, ainsi que des initiatives de formation/consultation. Connaissance de Pêches et Océans Canada (MPO), du ministère de la Défense nationale (MDN), de la Gendarmerie royale du Canada (GRC), de Transports Canada (TC), ainsi que des systèmes d'intervention, des programmes et du matériel de surveillance de la Garde côtière (identification et suivi à grande distance [LRIT], radars, caméras)." },
                    { 42, "Participates in project/program support activities. ", "Participe à des activités de soutien aux projets/programmes." },
                    { 63, "Monitors project/program expenditures and individual expenses for reporting purposes. Identifies wasteful financial practices or opportunities for greater efficiencies. Tracks and files variation reports. ", "Surveille les dépenses des projets/programmes et les dépenses individuelles à des fins d'établissement de rapports. Identifie les pratiques financières inutiles ou les possibilités d'amélioration de l'efficacité. Suivre et classer les rapports de variation. " },
                    { 64, "Analyzes unit cash flow trends. Maintains financial records and compares trends by period and year. Prepares statistical, financial, and accounting reports. Verifies and evaluates procedures used for recording financial transactions, and makes recommendations for changes to procedures, systems, and other financial controls. Provides guidance to members. ", "Analyse les tendances de roulement de fonds des unités. Tient à jour les registres financiers et compare les tendances par période et par année. Prépare des rapports statistiques, financiers et comptables. Vérifie et évalue les procédures utilisées pour l'enregistrement des transactions financières, et fait des recommandations sur les changements à apporter aux procédures, systèmes et autres contrôles financiers. Fournir des conseils aux membres. " },
                    { 65, "Analyzes broad accounting and financial records to ensure accuracy and compliance with established accounting standards and procedures. Plans, organizes, and administers financial tracking and reconciliation systems for Canadian Coast Guard programs and business lines. Prepares detailed reports and conducts audits to improve organizational financial management practices. Provides guidance to management. Designs, operates, and monitors rigorous systems for Financial Information Management, internal audit, and evaluation. ", "Analyse les documents comptables et financiers généraux afin de garantir l'exactitude et la conformité aux normes et procédures comptables établies. Planifie, organise et administre les systèmes de suivi et de rapprochement financier pour les programmes et les secteurs d'activité de la Garde côtière canadienne. Prépare des rapports détaillés et effectue des vérifications pour améliorer les pratiques de gestion financière de l'organisation. Fournir des conseils à la direction. Concevoir, exploiter et surveiller des systèmes rigoureux de gestion de l'information financière, de vérification interne et d'évaluation. " },
                    { 66, "Directs, controls, and evaluates the operation of financial and accounting departments. Reports on established trends with organizational recommendations for change. Ensures partner organizations, agencies, or governments understand the organization's complex fiscal issues. Develops and implements financial policies, establishes performance standards, and prepares various financial reports for senior management. Advises senior management on current and best practices in sound financial management practice and procedure. ", "Dirige, contrôle et évalue le fonctionnement des services financiers et comptables. Fait rapport sur les tendances établies avec des recommandations organisationnelles pour le changement. S'assure que les organisations, agences ou gouvernements partenaires comprennent les questions fiscales complexes de l'organisation. Élabore et met en œuvre des politiques financières, établit des normes de performance et prépare divers rapports financiers à l'intention de la haute direction. Conseille la haute direction sur les pratiques actuelles et les meilleures pratiques en matière de bonnes méthodes et procédures de gestion financière." },
                    { 67, "Conducts media monitoring and coverage analysis. Provides communication support services. Offers logistical support for media events and interviews.", "Effectue un suivi des médias et une analyse de la couverture médiatique. Fournit des services de soutien à la communication. Offre un soutien logistique pour les événements médiatiques et les interviews." },
                    { 68, "Writes and edits a range of communications products. Supports social media and websites. Assists in the development and/or implementation of communications products. Contributes to implementing communication plans or projects in the digital environment. ", "Rédige et édite une série de produits de communication. Prend en charge les médias sociaux et les sites web. Aide à l'élaboration et/ou à la mise en œuvre de produits de communication. Contribue à la mise en œuvre de plans ou de projets de communication dans l'environnement numérique. " },
                    { 69, "Produces communications products. Plans, coordinates, and/or implements announcements or special events such as town halls or media availabilities. Provides communication support to clients. Contributes to content of strategic communications plans. Monitors and analyzes multimedia coverage, providing tactical responses where requested. Uses social media to communicate in a government context. ", "Produit des produits de communication. Planifie, coordonne et/ou met en œuvre des annonces ou des événements spéciaux tels que les assemblées publiques ou les disponibilités des médias. Fournit un support de communication aux clients. Contribue au contenu des plans de communication stratégiques. Surveille et analyse la couverture multimédia, en fournissant des réponses tactiques si nécessaire. Utilise les médias sociaux pour communiquer dans un contexte gouvernemental. " },
                    { 41, "Expert knowledge in specialized methodologies of a field or fields and of their underlying concepts, theories, and principles. Extensive knowledge in the provision of coaching/guidance to staff, peers, and senior management.", "Connaissance approfondie des méthodologies spécialisées d'un ou de plusieurs domaines et de leurs concepts, théories et principes sous-jacents. Connaissances approfondies dans la prestation de services d'encadrement et d'orientation au personnel, aux pairs et aux cadres supérieurs." },
                    { 71, "Organizes and coordinates ministerial events. Leads the development, implementation, and evaluation of communications plans. Develops specialized communications products. In partnership with Fisheries and Oceans Canada (DFO) communications partners, leads or participates in external and internal stakeholder collaboration and major event responses. Manages media relations for sensitive issues. Develops and implements proactive media outreach strategies. Plans and executes extensive electronic (web and social media) communications initiatives.", "Organise et coordonne les événements ministériels. Dirige l'élaboration, la mise en œuvre et l'évaluation des plans de communication. Élabore des produits de communication spécialisés. En partenariat avec les partenaires de communication de Pêches et Océans Canada (MPO), dirige ou participe à la collaboration des intervenants externes et internes et aux réponses aux événements majeurs. Gère les relations avec les médias pour les questions sensibles. Élabore et met en œuvre des stratégies proactives de sensibilisation des médias. Planifie et exécute des initiatives de communication électronique (web et médias sociaux) de grande envergure." },
                    { 72, "Applies real property and accommodation management’s key elements and policies and identifies where to find related information. Supports activities related to real property and accommodation maintenance and operations. ", "Applique les éléments clés et les politiques de la gestion des biens immobiliers et des locaux et indique où trouver les informations correspondantes. Soutient les activités liées à l'entretien et au fonctionnement des biens immobiliers et des locaux. " },
                    { 73, "Assists in the writing of real property and/or accommodation management documents. Gathers information for planning, coordinating, and/or monitoring budgets. Assists in the search, analysis, and integration of information from different sources to formulate recommendations or action plans.", "Aide à la rédaction des documents de gestion des biens immobiliers et/ou des locaux. Recueille des informations pour la planification, la coordination et/ou le suivi des budgets. Aide à la recherche, à l'analyse et à l'intégration d'informations provenant de différentes sources afin de formuler des recommandations ou des plans d'action." },
                    { 74, "Interprets policies, standards, directives, or codes related to office accommodations or real property construction projects. Plans, organizes, or implements office accommodation or real property construction projects and analyses information and provides recommendations to clients or management. ", "Interprète les politiques, les normes, les directives ou les codes relatifs aux locaux ou aux projets de construction de biens immobiliers. Planifie, organise ou met en œuvre des projets de construction de locaux ou de biens immobiliers, analyse des informations et fournit des recommandations aux clients ou à la direction. " },
                    { 75, "Monitors marine structure projects, when and where applicable. Develops systems and/or processes, guidelines, and policies for identifying, collecting, maintaining, and evaluating real property and accommodations management information. ", "Surveille les projets de structures marines, le cas échéant. Élabore des systèmes et/ou des processus, des lignes directrices et des politiques pour identifier, recueillir, maintenir et évaluer les informations relatives à la gestion des biens immobiliers et des locaux. " },
                    { 76, "Identifies and implements risk and performance management strategies in assessing and planning real property and/or accommodations management projects. Develops plans and strategies that address the variety and complexity of real property and accommodations management operations, use, and maintenance.", "Identifie et met en œuvre des stratégies de gestion des risques et du rendement dans l'évaluation et la planification des projets de gestion des biens immobiliers et/ou des locaux. Élabore des plans et des stratégies qui tiennent compte de la variété et de la complexité des opérations, de l'utilisation et de l'entretien des biens immobiliers et de la gestion des locaux." },
                    { 77, "Describes the basic function of the business’s core systems. Defines objectives and success criteria of the specific role. Identifies sources of existing and potential information relating to the project. Documents consistently.", "Décrit la fonction de base des systèmes centraux de l'entreprise. Définit les objectifs et les critères de succès de la fonction spécifique. Identifie les sources d'informations existantes et potentielles relatives au projet. Documente de manière systématique." },
                    { 78, "Identifies key project milestones and defines project scope. Derives project estimates and quantifies uncertainty. Stores, references, and locates information in an efficient manner appropriate to the role. Validates, refines, and optimizes solution option models. Communicates difficult issues concisely and effectively to supervisors. Identifies potential areas of conflict and works to avoid their occurrence or their impact. ", "Identifie les étapes clés du projet et définit la portée du projet. Dérive les estimations du projet et quantifie l'incertitude. Stocker, référencer et localiser les informations de manière efficace et adaptée au rôle. Valide, raffine et optimise les modèles d'options de solution. Communique les questions difficiles de manière concise et efficace aux superviseurs. Identifie les zones potentielles de conflit et s'efforce d'éviter leur apparition ou leur impact. " },
                    { 79, "Identifies and minimizes risk to ongoing Coast Guard operations. Consistently identifies technology interfaces and focuses on integration aspects of projects. Identifies and defines proposed business benefits. Ensures planning tools and techniques are applied effectively. Through analysis of options, selects the option with the greatest business benefit bearing in mind the Coast Guard objectives. Articulates the vision, objectives, and benefits of a new initiative. Identifies current areas of conflict and seeks to understand apposing points of view. ", "Identifie et minimise les risques pour les opérations en cours de la Garde côtière. Identifie de manière cohérente les interfaces technologiques et se concentre sur les aspects d'intégration des projets. Identifie et définit les avantages opérationnels proposés. S'assure que les outils et les techniques de planification sont appliqués efficacement. Par l'analyse des options, sélectionne l'option présentant le plus grand avantage opérationnel en gardant à l'esprit les objectifs de la Garde côtière. Articuler la vision, les objectifs et les avantages d'une nouvelle initiative. Identifie les zones de conflit actuelles et cherche à comprendre les points de vue opposés." },
                    { 62, "Adheres to budget controls as assigned. Articulates a 'value for money' mindset. Provides correct financial information as required. ", "Respecte les contrôles budgétaires tels qu'ils ont été assignés. Il adopte un état d'esprit de 'l'optimisation des ressources'. Fournir des informations financières correctes, comme demandé." },
                    { 61, "Directs, controls, and evaluates the operations of the Canadian Coast Guard's workforce management discipline. Develops and implements policies, programs and procedures regarding workforce management planning, recruitment, training and development, and classification. Negotiates settlements of appeals and disputes and co-ordinates the termination of employment process, when and where applicable. Directs the organization's quality management program in relation to workforce management.", "Dirige, contrôle et évalue les opérations de la discipline de gestion des effectifs de la Garde côtière canadienne. Élabore et met en œuvre des politiques, des programmes et des procédures concernant la planification de la gestion des effectifs, le recrutement, la formation et le développement, et la classification. Négocie le règlement des appels et des différends et coordonne le processus de cessation d'emploi, le cas échéant. Diriger le programme de gestion de la qualité de l'organisation en ce qui concerne la gestion de la main-d'œuvre." },
                    { 70, "Provides strategic communications advice to managers. Develops and implements marketing and/or advertising plans, storyboards, and videos. Evaluates communications plans and develops associated communications products, when and where required. Coordinates and/or works within inter-governmental or multi-departmental communications initiatives, projects, or strategies. Extracts subject-matter experts while executing segmentation and audience analysis. Assists senior management in conveying messages on behalf of the Coast Guard in an appropriate manner that is consistent with established Acts, policies, and practices. Establishes networks with Fisheries and Oceans Canada (DFO) communications partners.", "Fournit des conseils en communication stratégique aux gestionnaires. Élabore et met en œuvre des plans de marketing et/ou de publicité, des story-boards et des vidéos. Évalue les plans de communication et développe des produits de communication associés, quand et où cela est nécessaire. Coordonne et/ou travaille dans le cadre d'initiatives, de projets ou de stratégies de communication intergouvernementaux ou multiservices. Extrait des experts en la matière tout en effectuant une segmentation et une analyse d'audience. Aider la haute direction à transmettre les messages au nom de la Garde côtière d'une manière appropriée et conforme aux lois, politiques et pratiques établies. Établit des réseaux avec les partenaires de communication de Pêches et Océans Canada (MPO)." },
                    { 59, "Identifies job vacancies and prospective recruiting requirements. Provides advice to managers related to recruitment, training, or HR systems. Interprets and applies legislation and policies related to workforce management functions. Determines eligibility to entitlements, arranges and delivers member training. Provides information or services such as employee assistance, counselling, and recognition programs, when and where applicable. ", "Identifie les offres d'emploi et les besoins de recrutement éventuels. Fournit des conseils aux gestionnaires en matière de recrutement, de formation ou de systèmes de ressources humaines. Interprète et applique la législation et les politiques relatives aux fonctions de gestion des effectifs. Détermine l'admissibilité aux droits, organise et dispense la formation des membres. Fournit des informations ou des services tels que l'aide aux employés, de councelling et des programmes de reconnaissance, le cas échéant. " },
                    { 44, "Actively promotes project goals, participants' roles, and the importance of project management principles, such as time, cost, and quality management. Participates, with minimal supervision, with others in all aspects of project or program. Seeks advice and guidance for more complex components of the project/program.", "Promouvoir activement les objectifs du projet, le rôle des participants et l'importance des principes de gestion du projet, tels que le temps, le coût et la gestion de la qualité. Participe, avec un minimum de supervision, avec d'autres personnes à tous les aspects du projet ou du programme. Demande des conseils et des orientations pour les éléments plus complexes du projet/programme." },
                    { 45, "Leads projects and/or programs. Leads project/program support activities, taking the initiative to gather additional information, keep documentation organized, and identify process improvements, when and where applicable. Provides advice to others who seek assistance within the project/program scope. ", "Dirige des projets et/ou des programmes. Dirige les activités de soutien aux projets/programmes, en prenant l'initiative de rassembler des informations supplémentaires, de garder la documentation organisée et d'identifier les améliorations des processus, le cas échéant. Fournir des conseils aux autres personnes qui demandent de l'aide dans le cadre du projet/programme. " },
                    { 46, "Responsibly delivers on the established mandate of a project/program. Directs teams to complete activities in accordance with current policies and practices. Provides accurate and timely recommendations to clients. Trains and advises anyone seeking guidance on basic to complex elements of project/program. ", "S'acquitte de manière responsable du mandat établi d'un projet/programme. Dirige les équipes pour qu'elles réalisent les activités conformément aux politiques et aux pratiques en vigueur. Fourni des recommandations précises et opportunes aux clients. Forme et conseille toute personne souhaitant obtenir des conseils sur les éléments de base ou complexes du projet/programme." },
                    { 47, "Monitors the quality and timeliness of individual responsibilities using the available resources, searching for clarity as needed. ", "Surveille la qualité et l'opportunité des responsabilités individuelles en utilisant les ressources disponibles, en recherchant la clarté si nécessaire." },
                    { 48, "Plans and organizes individual responsibilities to accomplish pre-determined standards or procedures. Monitors the quality and timeliness of work while leveraging the resources at immediate disposal.", "Planifie et organise les responsabilités individuelles pour accomplir des normes ou des procédures prédéterminées. Surveille la qualité et la rapidité du travail tout en tirant parti des ressources immédiatement disponibles." },
                    { 49, "Plans and organizes activities efficiently. Monitors the quality and timeliness of unit workloads. Uses available resources and seeks assistance to clarify priorities, when and where required. Reports on results to promote accountability. ", "Planifier et organiser les activités de manière efficace. Surveille la qualité et la rapidité des charges de travail des unités. Utilise les ressources disponibles et demande de l'aide pour clarifier les priorités, quand et où cela est nécessaire. Rend compte des résultats afin de promouvoir la responsabilité." },
                    { 50, "Efficiently plans and organizes activities for a unit. Establishes goals and objectives and anticipates obstacles realistically. Determines priorities and allocates resources effectively. Assists others and gives guidance as required.", "Planifier et organiser efficacement les activités d'une unité. Établit des buts et des objectifs et anticipe les obstacles de manière réaliste. Détermine les priorités et alloue les ressources de manière efficace. Assiste les autres et donne des conseils si nécessaire. " },
                    { 51, "Plans and organizes effectively while managing multiple demands and competing priorities. Influences processes and courses of action. Provides guidance and advice on a project or program area. ", "Planifie et organise efficacement tout en gérant des demandes multiples et des priorités concurrentes. Influence les processus et les lignes de conduite. Fournit des orientations et des conseils sur un projet ou un domaine de programme. " },
                    { 60, "Implements and evaluates workforce management policies, programs, and procedures. Working closely with clients or the workforce management team, collaborates in developing the merit criteria, assessment tools, and employment equity programs, offering strategic staffing ideas and assisting with performance management or disability files according to portfolio. Provides advice on the interpretation of policies, staffing, training, and benefits programs. Maintains workforce management information and related records systems. Hires and oversees training of staff. Co-ordinates employee performance appraisal programs. ", "Met en œuvre et évalue les politiques, programmes et procédures de gestion des effectifs. Travaille en étroite collaboration avec les clients ou l'équipe de gestion des effectifs, collabore à l'élaboration des critères de mérite, des outils d'évaluation et des programmes d'équité en matière d'emploi, propose des idées stratégiques de dotation en personnel et aide à la gestion des performances ou des dossiers d'invalidité selon le portefeuille. Fournit des conseils sur l'interprétation des politiques, la dotation en personnel, la formation et les programmes d'avantages sociaux. Tient à jour les informations sur la gestion des effectifs et les systèmes de dossiers connexes. Engage et supervise la formation du personnel. Coordonne les programmes d'évaluation de la performance des employés. " },
                    { 52, "Administers low-risk contracts. Monitors inventory levels of materials, equipment, and stock using manual or computerized inventory systems. Prepares requisition orders to replenish materials, equipment, and stock. Maintains stock rotation, disposes of and accounts for outdated stock. Enters data for production scheduling, stock replenishment, relocation, and inventory adjustments. Maintains a contractor database, insurance requirements, and pricing accuracy. ", "Administre les contrats à faible risque. Surveiller les niveaux d'inventaire des matériaux, des équipements et des stocks à l'aide de systèmes d'inventaire manuels ou informatisés. Préparer des ordres de réquisition pour réapprovisionner les matériaux, l'équipement et les stocks. Assurer la rotation des stocks, éliminer et comptabiliser les stocks périmés. Saisir les données pour la planification de la production, le réapprovisionnement des stocks, le déplacement et les ajustements des stocks. Tenir à jour une base de données sur les entrepreneurs, les exigences en matière d'assurance et l'exactitude des prix. " },
                    { 43, "Respects project/program goals, participants' roles, and the importance of project management principles. Participates in project support activities (i.e. gathering needed information). Participates with others in small and well defined components of the project/program.", "Respecte les objectifs du projet/programme, le rôle des participants et l'importance des principes de gestion de projet. Participe aux activités de soutien du projet (c'est-à-dire la collecte des informations nécessaires). Participe avec d'autres personnes à de petits éléments bien définis du projet/programme." },
                    { 53, "Monitors and reports on contract milestones and outcomes. Completes price variations in accordance with predetermined processes. Sources and obtains price quotations from catalogues and suppliers, and prepares purchase orders. Calculates cost of orders and charges or forwards invoices to appropriate accounts. Prepares and maintains purchasing files, reports, and price lists. Assesses requirements of clients and develops specifications for equipment, materials, and supplies to be purchased. ", "Surveiller et rendre compte des étapes et des résultats des contrats. Effectue les variations de prix selon des processus prédéterminés. S'approvisionne et obtient des prix relevés dans les catalogues et auprès des fournisseurs, et prépare les bons de commande. Calcule le coût des commandes et facture ou transmet les factures aux comptes appropriés. Prépare et tient à jour les dossiers d'achat, les rapports et les listes de prix. Évalue les besoins des clients et élabore les spécifications des équipements, des matériaux et des fournitures à acheter." },
                    { 54, "Manages medium-risk contracts including governance, risk, performance, and financial management. Purchases general and specialized equipment, materials, land or access rights, or business services for use or for further processing by the Canadian Coast Guard. Interprets and applies the terms and conditions of the contract to varied situations. Manages, or assists in the management of, all procedural aspects of purchasing activities. Adapts contract management practices in changing circumstances whilst maintaining the overall intent of the contract.  ", "Gère les contrats à risque moyen, y compris la gouvernance, le risque, la performance et la gestion financière. Acheter de l'équipement général et spécialisé, du matériel, des terres ou des droits d'accès, ou des services commerciaux pour l'utilisation ou le traitement ultérieur par la Garde côtière canadienne. Interprète et applique les conditions du contrat à des situations variées. Gérer ou aider à gérer tous les aspects procéduraux des activités d'achat. Adapte les pratiques de gestion des contrats en fonction de l'évolution des circonstances tout en respectant l'intention générale du contrat. " },
                    { 55, "Establishes delivery schedules, monitors progress, and contacts clients and suppliers to resolve problems in a work unit. Negotiates land acquisition or access rights for Coast Guard use, and may conduct field investigations of properties. Reviews and processes claims against suppliers. Monitors contract performance and identifies when corrective action needs to be taken to drive better outcomes. Assesses contract variations, and makes appropriate decisions based on risk. Invites tenders, consults with suppliers, and reviews quotations. Determines or negotiates contract terms and conditions, awards supplier contracts or recommend contract awards. Explores innovative contract management strategies for complex requirements with stakeholders.", "Établit les horaires de livraison, surveille les progrès et contacte les clients et les fournisseurs pour résoudre les problèmes dans une unité de travail. Négocie l'acquisition de terrains ou les droits d'accès pour l'usage de la Garde côtière, et peut mener des enquêtes sur le terrain concernant les propriétés. Examine et traite les réclamations contre les fournisseurs. Surveiller l'exécution des contrats et déterminer quand des mesures correctives doivent être prises pour obtenir de meilleurs résultats. Évalue les variations des contrats et prend les décisions appropriées en fonction des risques. Lance des appels d'offres, consulte les fournisseurs et examine les prix relevés. Détermine ou négocie les conditions des contrats, attribue les contrats des fournisseurs ou recommande l'attribution des contrats. Explore des stratégies novatrices de gestion des contrats pour les besoins complexes avec les parties prenantes." },
                    { 56, "Plans, organizes, directs, controls, and evaluates the purchasing activities of one or more work units. Identifies vendors of materials, equipment, or supplies. Participates in the development of specifications for equipment, products, or substitute materials. Interprets and advises on the terms and conditions of the contract, and applies to varied and complex situations. Monitors, evaluates and reports on contract milestones, key performance indicators adherence, performance metrics, and outcomes. Oversees the management of contracts and categories, and reports on contract activities that may result in political or public interest. Defines and advises on contract management responsibilities and processes across the Coast Guard. Drives the use of innovative contract management strategies where appropriate to deliver the best outcome and maximize value. Develops purchasing policies and procedures and controls purchasing department budget, when and where applicable.", "Planifie, organise, dirige, contrôle et évalue les activités d'achat d'une ou de plusieurs unités de travail. Identifie les fournisseurs de matériel, d'équipement ou de fournitures. Participe à l'élaboration de spécifications pour les équipements, les produits ou les matériaux de substitution. Interpréte et conseille les termes et conditions du contrat et s'applique à des situations variées et complexes. Surveille et évalue les étapes du contrat, le respect des indicateurs clés de performance, les mesures de performance et les résultats, et en rendre compte. Supervise la gestion des contrats et des catégories, et fait rapport sur les activités du contrat qui peuvent résulter d'un intérêt politique ou public. Défini et conseille sur les responsabilités et les processus de gestion des contrats au sein de la Garde côtière. Dirige l'utilisation de stratégies innovantes de gestion des contrats, le cas échéant, afin d'obtenir les meilleurs résultats et de maximiser la valeur. Élaborer des politiques et des procédures d'achat et contrôler le budget du service des achats, le cas échéant." },
                    { 57, "Coordinates a variety of recruitment, training, performance evaluation, HR systems, and classification activities. Prepares and proofreads forms and documents for and between the workforce management team or clients. Runs reports. Ensures that workforce management-related material is signed, dated, distributed, maintained, and filed appropriately. ", "Coordonne diverses activités de recrutement, de formation, d'évaluation des performances, de systèmes RH et de classification. Prépare et corrige des formulaires et des documents pour et entre l'équipe de gestion du personnel ou les clients. Produit des rapports. S'assure que les documents relatifs à la gestion des effectifs sont signés, datés, distribués, mis à jour et classés de manière appropriée. " },
                    { 58, "Compiles, maintains, and processes information relating to recruitment, training, performance evaluation, HR systems, or classification. Facilitates business line, workforce intelligence, succession planning, organizational awareness, and HR management practices. Arranges for advertising or posting job vacancies. Assists in screening of job applicants, and conducting of reference checks, when and where applicable.", "Compile, tenir à jour et traiter les informations relatives au recrutement, à la formation, à l'évaluation des performances, aux systèmes de RH ou à la classification. Facilite les pratiques de gestion des lignes d'activité, des renseignements sur les effectifs, de la planification de la relève, de la sensibilisation à l'organisation et de la gestion des RH. Organise la publication ou l'affichage des offres d'emploi. Aide à la sélection des candidats et à la vérification des références, le cas échéant. " }
                });

